INSERT INTO `tour_agendas` VALUES (539,1071,'06:00','19:00','Arrival in Rwanda.','You will be received by G-STEP TOURS driver/guide at Kigali International Airport and then Transfer to Mille Collins Hotel (Hotel Rwanda) for dinner and Overnight.','2019-06-13 13:25:11','2019-06-13 13:25:11'),(541,1073,'06:00','19:00','Game drive and Back to Kigali.','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch, relax a bit and dive back to Kigali for a beautiful Night City view.\r\n(Dinner and Overnight at Hotel De Mille Collins)','2019-06-13 13:27:09','2019-06-13 13:27:09'),(542,1074,'06:00','19:00','Kigali - Gorilla Trekking.','After breakfast, you will be transferred to the park headquarters in kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending your time with mountain gorillas, head to your Hotel for lunch and relaxation. (Dinner & Overnight at Bisate Lodge)','2019-06-13 13:29:06','2019-06-13 13:29:06'),(543,1075,'06:30','19:00','Goma  Congo  hiking mount Nyiragongo','Wake up at 6:30 am for breakfast at your hotel and be ready to cross to Congo and drive to the starting point of nyiragongo, start the trekking after the briefing. will spend a night at the top of Nyiragongo in cabins.','2019-06-13 13:30:08','2019-06-13 13:30:08'),(545,1077,'06:00','19:00','Drive to Queen Elizabeth National Park','After breakfast drive to Queen Elizabeth national park with a game drive through Ishasha sector to see the Tree climbing lions. Lunch enroute, Dinner and Overnight at Mweya safari lodge.','2019-06-13 13:34:52','2019-06-13 13:34:52'),(546,1078,'06:00','19:00','Game Drive in Queen Elizabeth','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. \r\nAfter lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. Dinner and overnight stay at Mweya Safari lodge.','2019-06-13 13:36:24','2019-06-13 13:36:24'),(547,1079,'06:00','19:00','Chimpanzee Tracking','Breakfast and Transfer to Kibale national park for afternoon chimpanzee tracking. Kibale forest is very rich in primate diversity and likelihoods of seeing species like the colobus monkeys and red tailed monkeys plus many monkey species. The forest walk will also offer an opportunity to see several birds and insects like butterflies along the forest track. After a wonderful chimpanzee safari, transfer to Crater Safari Lodge for dinner and overnight.','2019-06-13 13:37:11','2019-06-13 13:37:11'),(548,1080,'06:30','19:00','Departure','Have an early breakfast drive back to Kigali where you will have lunch and after lunch, your guide will transfer you to the Kigali International Airport for your flight back home.','2019-06-13 13:38:43','2019-06-13 13:38:43'),(549,1081,'06:00','19:00','Arrival in Rwanda.','You will be received by G-STEP TOURS driver/guide at Kigali International Airport and then Transfer to Mille Collins Hotel (Hotel Rwanda) for dinner and Overnight.','2019-06-13 15:41:37','2019-06-13 15:41:37'),(551,1083,'06:00','19:09','Game drive and Back to Kigali.','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch, relax a bit and dive back to Kigali for a beautiful Night City view.','2019-06-13 15:43:04','2019-06-13 15:43:04'),(552,1084,'06:00','19:00','Kigali - Gorilla Trekking.','After breakfast, you will be transferred to the park headquarters in kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending your time with mountain gorillas, head to your Hotel for lunch and relaxation. (Dinner & Overnight at Bisate Lodge)','2019-06-13 15:43:53','2019-06-13 15:43:53'),(553,1085,'06:30','19:00','Goma  Congo hiking mount Nyiragongo','Wake up at 6:30 am for breakfast at your hotel and be ready to cross to Congo and drive to the starting point of nyiragongo, start the trekking after the briefing. will spend a night at the top of Nyiragongo in cabins.','2019-06-13 15:45:03','2019-06-13 15:45:03'),(555,1087,'06:00','11:00','Drive to Queen Elizabeth National Park','After breakfast drive to Queen Elizabeth national park with a game drive through Ishasha sector to see the Tree climbing lions. Lunch enroute, Dinner and Overnight at Mweya safari lodge.','2019-06-13 15:47:02','2019-06-13 15:47:02'),(556,1088,'06:00','19:00','Game Drive in Queen Elizabeth.','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. \r\nAfter lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. Dinner and overnight stay at Mweya Safari lodge.','2019-06-13 15:48:04','2019-06-13 15:48:04'),(557,1089,'06:00','19:00','Chimpanzee Tracking','Breakfast and Transfer to Kibale national park for afternoon chimpanzee tracking. Kibale forest is very rich in primate diversity and likelihoods of seeing species like the colobus monkeys and red tailed monkeys plus many monkey species. The forest walk will also offer an opportunity to see several birds and insects like butterflies along the forest track. After a wonderful chimpanzee safari, transfer to Crater Safari Lodge for dinner and overnight.','2019-06-13 15:48:56','2019-06-13 15:48:56'),(558,1090,'06:00','19:00','Drive to Jinja','After Breakfast, drive to Jinja via Kampala Golf Course Hotel for Lunch. \r\nAfter Lunch continue to Jinja. Dinner and Overnight Jinja Nile Resort.','2019-06-13 15:49:47','2019-06-13 15:49:47'),(559,1091,'06:00','19:00','Drive to Kenya Wildlife Impala.','After breakfast, Drive to Kenya Wildlife Impala (4hrs). Dinner and overnight at Acacia Hotel.','2019-06-13 15:50:41','2019-06-13 15:50:41'),(560,1092,'06:00','19:00','Drive to Masai Mara National Park','Have breakfast and hit the road across the Great Rift Valley, where there are traditional Masai settlements and lakes, inhabited by thousands of flamingos, Arrive by afternoon in the famed Mara and venture into the Masai Mara Game Reserve for our first game drive and wildlife encounters. Dinner and overnight at Mara Serena Safari Lodge.','2019-06-13 15:51:28','2019-06-13 15:51:28'),(561,1093,'06:00','19:00','Masai Mara Game Reserve','Early breakfast followed by a game drive in the Masai Mara plains in search for the Big Five  leopard, lion, elephant, rhino and buffalo  as well as numerous grazing animals such as wildebeest, zebra and giraffe. Also includes good stocks of hippo and crocodile in the Mara River and an enormous variety of birds. The Mara encompasses many peoples ideal of Africa: rolling green hills, vast open horizons and plains stocked with wildlife. Dinner and Overnight at Mara Serena Safari Lodge.','2019-06-13 15:52:30','2019-06-13 15:52:30'),(562,1094,'06:00','19:00','Drive to Nairobi:','We leave the Mara After Breakfast, and drive to Giraffe Center. Dinner and Overnight at Hilton Hotel and Resort.','2019-06-13 15:53:38','2019-06-13 15:53:38'),(563,1095,'06:30','19:00','Departure','After breakfast, proceed to Jomo Kenyatta International Airport for departure flight.','2019-06-13 15:54:20','2019-06-13 15:54:20'),(609,1151,'06:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at Kigali International Airport and then Transfer you to Nyungwe National Park. (Dinner and Overnight at One &Only Nyungwe House)','2019-06-21 08:36:22','2019-06-21 08:36:22'),(610,1152,'18:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch. After Lunch, you will go for colobus Monkeys trek. (Dinner and Overnight at One &Only Nyungwe House)','2019-06-21 08:38:08','2019-06-21 08:38:08'),(611,1153,'05:30','18:00','Volcanoes National Park','At 7am depart Nyungwe forest to Volcanoes National Park. The drive is about 5hrs with breathtaking hilly view of the land of the thousand hills. (Dinner and Overnight at Bisate Lodge).','2019-06-21 08:40:12','2019-06-21 08:40:12'),(612,1154,'06:00','18:00','Gorilla Trekking','After breakfast, you will be transferred to the park headquarters in kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending your time with mountain gorillas, return to the base and meet your driver and a transfer for lunch and relaxation. After lunch you will go for Ibyiwacu cultural village to learn about culture in Village. (Dinner and Overnight at Bisate Lodge).','2019-06-21 08:41:41','2019-06-21 08:41:41'),(613,1155,'06:00','18:00','Kigali','After breakfast, Free to Tour on your own & go to the Crafts Market or any other place you with the help of our Guide.\r\nAfter lunch, your guide will transfer you to Kigali International Airport for your flight back home.','2019-06-21 08:43:01','2019-06-21 08:43:01'),(614,1156,'07:00','19:00','Uganda-Entebbe','Upon arrival at Entebbe Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel for a welcome meal, briefing about this great adventure Tour If time allows, take a city tour. Dinner and Overnight at the Jinja Nile Resort Hotel.','2019-06-21 09:33:17','2019-06-21 09:33:17'),(615,1157,'06:00','18:00','Uganda Museums.','After breakfast, take a boat ride to the source of the Nile a-quite beautiful place, filled with palm trees and fantastic tropical plants. You will take a Boat ride to the actual source of the river Nile and beyond the lake where you will take pictures e for future memories, after transfer to Kampala for lunch, after lunch you will visit Gaddafi Mosque, Kings Parliament, Kassubi Museum. Dinner and Overnight at Kampala Sheraton Hotel.','2019-06-21 09:34:31','2019-06-21 09:34:31'),(616,1158,'06:00','18:00','Queen Elizabeth National Park','After breakfast, drive to Queen Eliza Elizabeth National Park, pass to the Equator Scenic Area and take a photo (about 10 minutes). Arriving at Queen Elizabeth National Park, you will go for a 2 hours Boat ride on the Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Expect to view lots of hippos, crocodiles, monitor lizards, buffaloes, elephants, and lots others animals that come to channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. The channel also has a concentration of bird species. Dinner and Overnight at Mweya Safari Lodge.','2019-06-21 09:35:41','2019-06-21 09:35:41'),(617,1159,'06:30','18:00','Queen Elizabeth Game Drive','Be up for breakfast at 6.30 and start the morning game drive at 7.00am. its a good opportunity for great wildlife sights. Drive along the Kasenyi game trail and see elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks.\r\nAfter more than 4 hours of great wildlife sights, return to the lodge for a relaxation and have lunch. After lunch Drive to Bwindi National park. overnight and Dinner at Ruhija Gorilla Lodge.','2019-06-21 09:37:45','2019-06-21 09:37:45'),(618,1160,'06:00','18:00','Uganda Gorilla Trekking','Be up by 6.00am for breakfast, grab our lunch and drive to the park offices, you will join other trekkers for gorilla trekking briefing by your guide/ranger. The gorilla trekking expedition starts at around 8am.  After a few minutes to several hours depending how fast you locate your assigned gorilla family, you will be able to enjoy your moment with the amazing Gorillas. After the gorilla experience you will go for BATWA CULTRAL EXPERIENCE, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Dinner and Overnight at Ruhija Gorilla Lodge.','2019-06-21 09:39:05','2019-06-21 09:39:05'),(620,1162,'06:00','18:00','Nyungwe National Park.','After breakfast, we shall enjoy a boat cruise to visit the nearby Islands and hot springs thereafter, we return the land and transfer to Nyungwe forest which is made up of a variety of habitats including montane forests, bamboos, grasslands, and swamps. This is a home to 13 primate species such as Chimpanzees, endangered Golden monkeys, Blue Monkeys, colobus, red tailed monkey. There are also about 300 bird species. Relax in the evening as we wait for dinner and overnight at Nyungwe top view hotel.','2019-06-21 13:49:05','2019-06-21 13:49:05'),(621,1163,'06:00','18:00','Kigali airport.','Moring After breakfast, you will go for canopy walk adventure. This canopy walk takes close to 2 hours and its starting and end point being Nyungwe National park headquarters- the Uwinka tourist reception center. The first 200m is a walk Along the forest trail under the thick canopies for an opportunity of viewing the ground level nature.  *Before taking on the canopy walk way to get to the top level of the forest. The prominent sightings here include; the monkeys, including the blue monkeys, Lhotses monkeys, black and white colobus, the red tailed monkeys and the birds. *The minimum age for this walk is 6years and the kids must be escorted by the adults. *Remember to carry a rain coat. The hiking shoes are also vital and both of these can be rented from the reception center*The walking sticks are provided free of charge. You will later be dropped at Kigali International airport to catch up with your departure flight.','2019-06-21 13:50:16','2019-06-21 13:50:16'),(622,1164,'06:00','19:00','Arrival in Rwanda','Our representative will be at Kigali Airport to pick you up from your flight and transfer you to Mgahinga National Park (3 h 33min via Cyanika boarder) Overnight at Mount Gahinga Lodge.','2019-06-21 14:26:33','2019-06-21 14:26:33'),(623,1165,'07:00','19:00','Uganda Gorilla Trekking.','Be up by 7.00am for breakfast, grab our lunch and drive to the park offices, you join other trekkers for gorilla trekking briefing by your guide/ranger. The gorilla trekking expedition then starts at about 8am a few minutes to several hours depending how fast you locate your assigned gorilla family. After drive to Lake Bunyonyi Overnight and dinner at Bird Nest Resort.','2019-06-21 14:27:55','2019-06-21 14:27:55'),(624,1166,'06:00','19:00','Drive to Queen Elizabeth National Park','After breakfast drive to Queen Elizabeth national park with game drive through Ishasha sector to see the tree climbing lions. Lunch en route, dinner and Overnight at Mweya safari lodge.','2019-06-21 14:28:38','2019-06-21 14:28:38'),(625,1167,'06:00','19:00','Game Drive - Kazinga Channel','After breakfast do a morning game drive see animals such as Leopard, Lion, Elephants, buffaloes, warthogs and many more, lunch at Mweya lodge and embark on afternoon boat cruise on the Kazinga channel to see huge Nile crocodiles, hippos and Buffaloes / Elephants basking along the shores, dinner and overnight at Mweya lodge.','2019-06-21 14:29:59','2019-06-21 14:29:59'),(626,1168,'06:00','19:00','Chimpanzee Tracking','Breakfast and Transfer to Kibale national park for afternoon chimpanzee tracking. Kibale forest is very rich in primate diversity and likelihoods of seeing species like the colobus monkeys and red tailed monkeys plus many monkey species are very high. Besides seeing chimps to your satisfaction in the forest, the forest walk will offer an opportunity to see several birds and insects like butterflies along the forest track. After a wonderful chimpanzee safari, transfer to Primate Lodge for dinner and overnight.','2019-06-21 14:31:06','2019-06-21 14:31:06'),(628,1170,'06:00','19:00','Kampala City Tour','Drive to Kampala via Mubende  Mityana highway, the journey to Kampala takes about 6h 20 min. Overnight at Sheraton Hotel.','2019-06-21 14:33:21','2019-06-21 14:33:21'),(629,1171,'06:00','19:00','Boat ride on the source of River Nile.','Boat ride to source of River Nile, drive to Mbarara town withen route stop at the Equator(6-7 hrs.) Dinner and overnight at Igongo cultural center','2019-06-21 14:34:21','2019-06-21 14:34:21'),(630,1172,'06:00','19:00','Back to Rwanda','Drive to Kigali via Katuna boarder (5hrs), drive around Kigali city, visit Gisozi genocide museum, dinner and overnight at Serena Hotel.','2019-06-21 14:35:07','2019-06-21 14:35:07'),(631,1173,'06:30','19:00','Ibyiwacu villageCommunity walk','Drive to Volcanoes national park (2hrs) for Ibyiwacu cultural tour, and evening community walk. Dinner and overnight at Mountain Gorilla View Lodge.','2019-06-21 14:37:26','2019-06-21 14:37:26'),(632,1174,'06:30','19:00','Travel to kibuye','After breakfast, MEET the 3 pygmies and transfer to Kibuye. Overnight atMoriah Hill Hotel.','2019-06-21 14:38:32','2019-06-21 14:38:32'),(633,1175,'06:30','19:00','Departure','After breakfast, drive to Kigali with en route visit to the Rwanda national museum in Butare / Huye. After lunch, then continue to the Kigali International airport for your flight.','2019-06-21 14:39:28','2019-06-21 14:39:28'),(647,1187,'06:00','19:00','Arrival in Kigali','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali. Dinner and Overnight stay at Grand Legacy Hotel.','2019-06-24 12:21:43','2019-06-24 12:21:43'),(648,1188,'06:00','19:00','Pick up from Hotel to Nyungwe NP','Early morning enjoy your breakfast and drive heading to the western province, on your way visit the Ethnographic Museum in Southern Province and later head for an enroute lunch. After lunch you head to Nyungwe National Park for a canopy walk and return in the afternoon for dinner and overnight stay at Nyungwe Top View Hill Hotel.','2019-06-24 12:22:47','2019-06-24 12:22:47'),(649,1189,'06:00','19:00','Chimpanzee Trekking and Lake Kivu','After breakfast, report to the park headquarters in Nyungwe forest for briefing before going for chimpanzee tracking. However, it is advisable to organize packed lunch and plenty of water prior to this expedition since it can sometimes last over 6 hours. In the forest, you will not only see chimpanzees to but also variety of animals and birds like the Rwenzori Turacco, black and white casqued horn bill, colobus monkeys  sometimes as many as 400 in a group. After here will drive to Karongi.\r\n(Dinner and Overnight at Kivu Lodge).','2019-06-24 12:24:25','2019-06-24 12:24:25'),(650,1190,'06:00','19:00','Lake kivu and Transfer to Volcanoes NP','Early morning after breakfast, do boat ride in lake kivu visiting Amahoro Island, Inyenyeri Island, Napoleon Island after enjoying kivu lake you will be driving from Kibuye to Volcanoes National Park. \r\n(Dinner and Overnight stay at Mountain Gorilla View Lodge).','2019-06-24 12:26:08','2019-06-24 12:26:08'),(651,1191,'06:00','19:00','Golden Monkeys Trekking-drive to Kigali','This morning after quick breakfast, you will be at Kinigi reception for breathing about Golden monkeys in Rwanda live in the bamboo vegetation towards the base of the volcanoes and habituation has helped them to overcome their initial shyness to accept their daily visit by researchers and tourists. They are very active creatures, and jump from tree to tree which is really interesting and a little difficult to photograph!The golden monkey trek is worth going for while in Volcanoes National Park and if youre interested in wildlife, this is a rare and delightful experience not to be missed!\r\nHalfway back to the city, we will stop in Nyirangarama for shopping snacks then you will be driven back to Grand Legacy Hotel for Dinner and Overnight.','2019-06-24 12:28:24','2019-06-24 12:28:24'),(653,1193,'06:00','19:00','Game Driver and Back to Kigali','After an early morning breakfast at 6:00 am and leave for an early morning game drive in Akagera national park to catch up with late hunters and early risers. We will be searching for the big mammals like Elephants, Giraffes, Buffaloes, several Antelope species, and recently the re-introduced Lions and Rhinos. The park is a varied habitat for wildlife and a number bird species with over 500 bird species in the park making it a birding paradise. Meal Plan Breakfast- lunch.\r\nYou will leave the lodge with parked lunch for the game drive which will last about 6 hours depending on your interests before starting the journey back to Kigali. You will take the route along the lake which more often has a variety of animals to site along.  You will later be dropped at the lodge or airport to catch up with your afternoon flight.\r\nEnd of safari.','2019-06-24 12:32:05','2019-06-24 12:32:05'),(654,1194,'06:00','19:00','Arrival in Kigali','You will be received by G-STEP TOURS drive/guide at the airport. Depending on your arrival time, if you arrive night time, we check into Kigali Serena Hotel for relaxation moment after the long flight.','2019-06-24 13:40:13','2019-06-24 13:40:13'),(655,1195,'06:00','19:00','City tour and transfer to Volcanoes NP','Early morning after breakfast have small city tour by visiting Gisozi memorial site. After that we drive to Musanze for ibyiwacu culture village to learn about culture in village. This culture gives you a chance to meet the local people in their nature environment where by visitors has expected genuine and warm welcome accompanied by warm music, dance and dram which is amazing! All these are offered to visitors in a rich culture, you just sit and relax while enjoying. Dinner and rest at five Hotel.','2019-06-24 13:41:12','2019-06-24 13:41:12'),(658,1196,'06:00','19:00','Golden Monkey Trekking-Local activities','This morning after quick breakfast, you will be at Kinigi reception for a briefing about Golden monkeys in Rwanda live in the bamboo vegetation towards the base of the volcanoes and habituation has helped them to overcome their initial shyness to accept their daily visit by which is really interesting and a little difficult to photograph!\r\nThe golden monkey trek is worth going for while in Volcanoes National Park and if youre interested in wildlife, this is a rare and delightful experience not to be missed! After Golden monkey experience returns to your lodge for lunch and relax. After lunch take tour for Local community activities.\r\nin this activity you will have an access to cooking, playing with family kids, getting an experience of how Rwandan used to make conversation with their kids as well as enjoying different local games this activity will take 3-5 hours after this activity driver will take you back to your hotel for dinner and overnight.','2019-06-24 13:43:39','2019-06-24 13:43:39'),(660,1197,'06:00','19:00','Transfer to GisenyiBoat ride','We leaveVolcanoes national park right after breakfast. Our drive will partly along the Congo -Nile trail with views of Lake Kivu and its Islands on our way, arriving at Gisenyi where we visit the fishing village, visit DRC-Rwanda border (Gisenyi town) and relax at the lakeside in the evening. This will offer the much needed rest before you embark on journey to Nyungwe National Park.\r\nDinner and overnight  at Nyungwe Top View hill hotel.','2019-06-24 13:45:28','2019-06-24 13:45:28'),(661,1198,'06:00','19:00','Canopy - Kamiranzovu water fall','After our breakfast, we shall head for our morning Canopy walkway.\r\nThis canopy walk also takes close to 2 hours and its starting and end point being Nyungwe National park headquarters- the Uwinka tourist reception center.Thefirst200m is a walk along the forest trail under the thick canopies for an opportunity of viewing the ground level nature before taking on the canopy walkway to get to thetolevelof the forest. The prominent sightings here include; the monkeys, including the blue monkeys, LHoests monkeys, black and white colobus, the red tailed monkeys and the birds. The minimum age for this walk is 6 years and the kids must be escorted by the adults.  remember to carry a rain coat. The hiking shoes are also vital and both of these can be rented from the reception center. The walking sticks are provided free of charge.About the difficulty, this hike is so easy and takes only 2 hours to complete it. after that adventure experience you will visit Kamiranzovu Water fall,where you shall  enjoy water Trail. \r\nThis  Kamiranzovu water fall is divided into two parts : The lower part on huge rock which is a beautiful spot for photography whereas he second side is front o the falling water. you will also amazed by wildlife and plant species, the Rwanda development board  has recoded through 38 reptiles and 1,068 plants species, all which add to the final  satisfaction of the  traveller. Dinner and Overnight at Nyungwe Top view hill Hotel.','2019-06-24 13:47:27','2019-06-24 13:47:27'),(663,1200,'06:00','19:00','Akagera game drive- Kigali Airport','Early morning after breakfast, Do a Morning game drive enjoying the beautiful sceneries of Rwandas hill landscape, comprised of a blend of wetland, savannah, and woodland, the natural forests also make quite a view. The location of the park shows that it lies at a lower altitude as compared to rest of the country, therefore meaning that it is not only warmer but drier. Some of the wildlife you will see here include Giraffes, Buffalos, and Elephants as well as a profusion of birds. If fortunate, we may be able to sight at the Shoebill Stork, especially around the shores of the lake. after that adventure experience you will  drive back to kigali  airport for flight.','2019-06-24 13:52:04','2019-06-24 13:52:04'),(680,1221,'06:00','19:00','Arrival in Kigali','You will be received by G-STEP TOURS driver/guide at Kigali International Airport and then Transfer to your Hotel for dinner and Overnight','2019-06-25 12:03:37','2019-06-25 12:03:37'),(681,1222,'06:00','19:00','Transfer to Akagera','Morning After Breakfast, you will drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. \r\n (Dinner and Overnight at your Hotel inside the Park)','2019-06-25 12:05:33','2019-06-25 12:05:33'),(682,1223,'06:00','19:00','Game drive and Back to Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch, relax a bit and dive back to your Hotel in Kigali and for a beautiful Night City view','2019-06-25 12:06:51','2019-06-25 12:06:51'),(683,1224,'06:00','19:00','Kigali- Nyungwe National Park','After breakfast in Kigali, you will drive to Nyungwe national park for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! After that, you will head to your Hotel','2019-06-25 12:07:39','2019-06-25 12:07:39'),(684,1225,'06:00','19:00','Chimpanzee Trekking Volcanoes NP','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch, before being transferred to Volcanoes National Park. This is a 5hr30min drive from Nyungwe to Volcanoes National Park where you will connect to your Hotel for relaxation','2019-06-25 12:08:31','2019-06-25 12:08:31'),(686,1227,'06:00','19:00','Return to Kigali-Rwanda','After breakfast, Free to Tour on your own & go to the Crafts Market or any other place you with the help of our Guide.\r\nAfter lunch, your guide will transfer you to Kigali International Airport for your flight back home','2019-06-25 12:11:19','2019-06-25 12:11:19'),(690,1231,'06:00','19:00','Arrival in Rwanda','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali.  Dinner and Overnight stay at Grand Legacy Hotel','2019-06-25 13:11:52','2019-06-25 13:11:52'),(691,1232,'06:00','19:00','Gorilla Trekking-Ibyiwacu Village','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear, drinking water and packed lunch, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch and refresh at your lodge. After lunch take a visit to Ibyiwacu cultural village. Dinner and overnight at Mountain Gorilla View Lodge','2019-06-25 13:14:46','2019-06-25 13:14:46'),(692,1233,'06:30','19:30','Travel to Kibale NP','Be up at 6.30am for breakfast, check out of Mountain Gorilla View lodge and drive to Uganda The drive takes you crossing the border Kibale takes approximately 6 hours. This is a scenic drive through the Kigezi highlands commonly known as the Switzerland of Africa. Overnight stay at Crater Safari Lodge','2019-06-25 13:16:04','2019-06-25 13:16:04'),(693,1234,'06:00','19:00','Chimps trekking-Queen Elizabeth NP','At 7.00 am local time assemble park headquarters for the briefing from the senior park ranger and at 8.00 am your guide will transfer you to the starting point for chimpanzee tracking. Normally the whole activity takes less than 4 hours. Later the guide will lead you to Lodge for lunch. In the afternoon enjoy a nature walk in the Bigodi community Sanctuary anticipating a variety of forest birds and primates including different monkey species.\r\nIn the evening transfer to Queen Elizabeth national park. It takes 2 hours to get to Queen Elizabeth national park. Overnight stay at Mweya Safari','2019-06-25 13:20:14','2019-06-25 13:20:14'),(694,1235,'06:00','19:00','Game drive-Boat cruise','After breakfast do a morning game drive anticipating early risers including predators and other nocturnal mammals before they retreat to their hideouts. Expect mammals including hippos, buffaloes, hartebeests, leopard, lions, etc and a plethora of both endemic and migratory birds. Return to the lodge for lunch. After lunch transfer to the Kazinga Channel for a boat cruise. The Channel is a magnet to all wildlife in this park. It boasts of a big number of birds than any single destination in Africa. Retire to your lodge for relaxation. Overnight stay at Mweya Safari Lodge','2019-06-25 13:21:09','2019-06-25 13:21:09'),(696,1237,'06:00','19:00','Arrival in Congo - Goma','A tour in Goma, Visit Virunga National Park in a distance in a car\r\nAfter city tour transfer to your hotel in Gisenyi (Rwanda) For relaxation','2019-06-25 14:35:28','2019-06-25 14:35:28'),(697,1238,'06:00','19:00','Gisenyi-Ruhengeri/Rwanda','After breakfast, visit Lake Kivu\r\nTransfer to Ruhengeri, enjoy the beautiful view on the road\r\nArrival, check in Hotel, rest','2019-06-25 14:39:47','2019-06-25 14:39:47'),(698,1239,'06:00','19:00','Ruhengeri-Lake Bunyonyi/Uganda','After breakfast, transfer to Iby\'iwacu Cultural Village for a 3-hour visit,\r\n2-hour visit in the Lake Burera and Lake Ruhondo.\r\nBack to hotel for lunch\r\nDrive to LAKE BUNYONYI\r\nArrival, check in and rest','2019-06-25 14:40:40','2019-06-25 14:40:40'),(699,1240,'06:00','19:00','Lake Bunyonyi-Bwindi Impenetrable NP','After breakfast, a tour of Lake Bunyonyi\r\nStay in Bwindi Impenetrable National Park for the night','2019-06-25 14:42:03','2019-06-25 14:42:03'),(700,1241,'06:00','19:00','Bwindi Impenetrable NP','Visit Bwindi impenetrable national park for the day','2019-06-25 14:42:49','2019-06-25 14:42:49'),(702,1243,'06:00','19:00','Queen Elizabeth National Park','After breakfast, visit Queen Elizabeth National Park by car.\r\nAt sunset, have dinner and rest in Hotel','2019-06-25 14:45:14','2019-06-25 14:45:14'),(703,1244,'06:00','19:00','Queen Elizabeth NP-Equatorial line-Jinja','After breakfast, drive to Jinja.\r\nArrival, check in hotel to rest','2019-06-25 14:47:23','2019-06-25 14:47:23'),(704,1245,'06:00','19:00','Jinja--Kampala','After breakfast, drive to Nile. \r\nAfter lunch, arrive at border of Nile. Take a boat to visit Nile\r\nDrive to Kampala\r\nArrival, rest in hotel','2019-06-25 14:48:01','2019-06-25 14:48:01'),(705,1246,'06:00','19:00','Kampala--Entebbe / Rwanda','After breakfast, visit Uganda National Museum and Bahai Temple.\r\nTransfer to Tombs of Buganda Kings at Kasubi, visit Tombs of Buganda Kings at Kasubi.\r\nDrive to Entebbe, have dinner.\r\nAfter dinner, transfer to airport, fly to Kigali City\r\nArrival, rest in hotel','2019-06-25 14:49:01','2019-06-25 14:49:01'),(706,1247,'06:00','19:00','Kigali','After breakfast, a tour in Kigali City.\r\nAfter dinner, rest in hotel','2019-06-25 14:50:15','2019-06-25 14:50:15'),(707,1248,'06:00','19:00','Kigali/ Bujumbura/ Burundi','After breakfast, continue visiting Kigali City.\r\nAfter lunch, transfer to airport.\r\nFly to Bujumbura.\r\nArrival, rest in hotel','2019-06-25 14:51:23','2019-06-25 14:51:23'),(720,1267,'15:30','18:00','Arusha (Tanzania)','Arrival at Airport and meet a driver guide who will transfer you to your respective hotel/lodge in Arusha. On arrival, check in at your Hotel where you will spend a night.','2019-06-27 16:20:54','2019-06-27 16:20:54'),(723,1268,'06:00','18:30','Arusha - Serengeti National Park','After breakfast, drive to Serengeti national park home to 3 million animals which is larger than any savannah protected area on earth. When you enter Serengeti before you check in your lodge, you will visit the UNESCO heritage site Oduvai gorge where the early humans thought to have occupied about 2 million years ago. You will learn much about the human evolution with the research of Dr. Louis leaky who discovered the human skull and other fossils at the site in 1960. Continue to your lodge inside Serengeti.','2019-06-27 16:22:08','2019-06-27 16:22:08'),(724,1269,'07:00','18:00','Serengeti National Park','Serengeti offers best wildlife viewing opportunities. It is home to 3 million animals, including large prides of lions, herds of elephants, wildebeest, gazelles, buffalo, buffalo, zebras, and a variety of birds like ostrich. The game drive will start at sunrise explore the area to spot nearly all the large mammals mentioned above. You will return to the camp for lunch. In the afternoon animals will be more active and continue with your game drive. Theres an option to do a hot air balloon safari over the Serengeti.','2019-06-27 16:23:14','2019-06-27 16:23:14'),(725,1270,'07:00','18:00','Serengeti National Park -Arusha','On your last day, you will enjoy an early morning game drive. At 10am you return and transfer to Arusha airport for your return flight home.','2019-06-27 16:24:26','2019-06-27 16:24:26'),(749,1312,'15:00','18:00','KIGALI','Arrive at Kigali International Airport, meet and greet with G-STEP TOURS driver/Guide and then transfer to your accommodation. If there is time after your arrival, you will do a tour of Kigali City and visit some interesting places, of which not to be missed are the local crafts markets and the Gisozi Genocide Memorial site. You shall be amazed by the cleanliness, organization, and development of this city. It also is one of the safest and fastest growing city. Dinner and Overnight at Hill View Hotel.','2019-07-22 10:20:05','2019-07-22 10:20:05'),(750,1313,'08:00','18:00','Kigali -Akagera National Park','Have early breakfast and prepare to start the trip. Leave for Akagera National Park which is located on the northeastern edge of Rwanda, along the border with Tanzania. Akagera is Rwandas largest national park, covering 1085 square kilometers of savannah, mountain and swamp habitat. A safari in Akagera rewards with one of the most scenic landscape in Africa, that is populated with a lot of wildlife, and is still undiscovered. On arrival to the park, you will do a short game drive for your first animal sightings, and enjoy the beautiful scenery of the park. From the game drive transfer to your accommodation, have lunch and relax. In the afternoon you will do a boat safari on Lake Ihema to spot water animals such as Hippos, Crocodile, plenty of water birds and other wildlife that flocks the shores to drink and cool in the water. Return to the lodge for dinner and overnight at Akagera Game Lodge.','2019-07-22 10:20:51','2019-07-22 10:20:51'),(751,1314,'06:30','18:00','Akagera National Park -Kigali','After an early morning breakfast at 6:00 am and leave for an early morning game drive in Akagera national park to catch up with late hunters and early risers. We will be searching for Elephants, Giraffes, Buffaloes, several Antelope species, Lions and more. The park is a varied habitat for wildlife and a number bird species with over 500 bird species in the park making it a birding paradise. \r\nYou will leave the lodge with parked lunch for the game drive which will last about 6 hours depending on your interests before starting the journey back to Kigali. You will take the route along the lake which more often has a variety of animals.  You will later be dropped at Hill View Hotel for Dinner and Over Night.','2019-07-22 10:22:13','2019-07-22 10:22:13'),(752,1315,'08:00','18:00','Kigali -Volcanoes National Park','Breakfast and drive to Musanze for ibyiwacu culture village to learn about culture in village. This culture gives you a chance to meet the local people in their nature environment where by visitors has expected genuine and warm welcome accompanied by warm music, dance and dram which is amazing! All these are offered to visitors in a rich culture, you just sit and relax while enjoying. After that, will head for Lunch and later drive to Nkosti Village (Red Rocks) for activities that the client will decide on which include; Basket weaving, Village walking, Bee Keeping, Drumming Lessons, Banana Beer Making. Dinner and Overnight at Classic Lodge','2019-07-22 10:24:33','2019-07-22 10:24:33'),(753,1316,'05:30','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel or do a take away in Boxes, then drive for less than 20minutes to Volcanoes National park headquarters in kinigi for a briefing about the endangered mountain gorillas. \r\nAlong with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, on meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending about one hour with the mountain gorillas, return to the base and meet your driver and a transfer for lunch and relaxation.\r\nAfter lunch, you will go for twin lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. During this tour you will the best view of five mountains. Dinner and Overnight at Classic Hotel.','2019-07-22 10:33:22','2019-07-22 10:33:22'),(755,1318,'08:00','18:00','Kibuye- Nyungwe National Park','Early morning after breakfast, you will do a boat ride at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park.\r\nThe distance from Karongi to Nyungwe National Park its about 95.3Km and road takes about 2hours with no rush. Dinner and Overnight at Nyungwe Top View Hotel.','2019-07-22 10:43:36','2019-07-22 10:43:36'),(756,1319,'05:00','18:00','Nyungwe National Park','After Breakfast which is served from 5 to10am, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest.\r\nTrekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\n\r\nAfter lunch, you will visit canopy walkway. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Later return to your lodge for dinner and overnight.','2019-07-22 10:44:22','2019-07-22 10:44:22'),(757,1320,'08:00','18:00','Nyungwe National Park -Kigali','Early Morning enjoy your breakfast and leave the hotel to Kigali, on your way visit the Ethnographic Museum and the Royal palace museum in Nyanza. After lunch drive to Kigali. Dinner and Overnight at Hill View Hotel.','2019-07-22 10:46:15','2019-07-22 10:46:15'),(758,1321,'08:30','18:00','KIGALI','After breakfast, proceed to Kigali International Airport for your departure flight.','2019-07-22 10:50:12','2019-07-22 10:50:12'),(759,1322,'20:00','18:00','KIGALI','Arrive at Kigali International Airport, meet and greet with G-STEP TOURS driver/Guide and then transfer to your accommodation. If there is time after your arrival, you will do a tour of Kigali City and visit some interesting places, of which not to be missed are the local crafts markets and the Gisozi Genocide Memorial site. You shall be amazed by the cleanliness, organization, and development of this city. It also is one of the safest and fastest growing city. Dinner and Overnight at Mille Collins Hotel.','2019-07-22 12:47:05','2019-07-22 12:47:05'),(760,1323,'08:30','18:00','Kigali -Akagera National Park','Have early breakfast and prepare to start the trip. Leave for Akagera National Park which is located on the northeastern edge of Rwanda, along the border with Tanzania. Akagera is Rwandas largest national park, covering 1085 square kilometers of savannah, mountain and swamp habitat. A safari in Akagera rewards with one of the most scenic landscape in Africa, that is populated with a lot of wildlife, and is still undiscovered. On arrival to the park, you will do a short game drive for your first animal sightings, and enjoy the beautiful scenery of the park. From the game drive transfer to your accommodation, have lunch and relax. In the afternoon you will do a boat safari on Lake Ihema to spot water animals such as Hippos, Crocodile, plenty of water birds and other wildlife that flocks the shores to drink and cool in the water. Return to the lodge for dinner and overnight at Akagera Game Lodge.','2019-07-22 12:48:04','2019-07-22 12:48:04'),(761,1324,'06:30','18:00','Akagera National Park -Kigali','After an early morning breakfast at 6:00 am and leave for an early morning game drive in Akagera national park to catch up with late hunters and early risers. We will be searching for Elephants, Giraffes, Buffaloes, several Antelope species, Lions and more. The park is a varied habitat for wildlife and a number bird species with over 500 bird species in the park making it a birding paradise. \r\nYou will leave the lodge with parked lunch for the game drive which will last about 6 hours depending on your interests before starting the journey back to Kigali. You will take the route along the lake which more often has a variety of animals.  You will later be dropped at Hotel Mille Collins for dinner and overnight.','2019-07-22 12:49:17','2019-07-22 12:49:17'),(762,1325,'08:30','18:00','Nyungwe National Park -Kibuye','After breakfast in Kigali, you will drive to Nyungwe national park for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! After canopy adventure you will go for lunch before being transferred to Karongi. This is a 2hr50min drive from Nyungwe to Karongi where you will Connect to your Hotel for relaxation.  Dinner and Overnight at Kivu Lodge.','2019-07-22 12:50:41','2019-07-22 12:50:41'),(763,1326,'08:30','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi its about 124Km and road takes about 3hours with no rush. Arriving at Gisenyi where we visit Hot spring, visit DRC-Rwanda border (Gisenyi town) \r\n(Dinner and Overnight at Lake Kivu Serena Hotel)','2019-07-22 12:51:43','2019-07-22 12:51:43'),(765,1328,'05:30','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel or do a take away in Boxes, then drive for less than 20minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement.\r\nThey live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting.\r\nAfter the Trek, will head for Lunch and later drive to Twin lake. enjoy fishing activities, beautiful hills in the surrounding of the lake. Your boat cruise is safe as there no more waves as the lake is surrounded by hills. Dinner and Overnight at Mountain Gorilla View Lodge.','2019-07-22 13:27:59','2019-07-22 13:27:59'),(766,1329,'08:00','18:00','Volcanoes National Park - Kigali','Early morning after breakfast, you will visit Musanze caves. After Musanze Caves, you will go for cultural experience with one of the local tribes living near the caves, here will learn the art of making hunting tools like bows and arrows, weaving the Agaseke basket using fingers, brewing local bear (known as Urwagwa) using bananas. After the activities, will return to Kigali for Dinner and Overnight at Mille Collins Hotel.','2019-07-22 13:31:22','2019-07-22 13:31:22'),(767,1330,'08:30','18:00','KIGALI','After breakfast, proceed to Kigali International Airport for your departure flight.','2019-07-22 13:33:57','2019-07-22 13:33:57'),(774,1349,'15:30','18:00','KIGALI','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to the Flame Tree Village for overnight and dinner.','2019-07-25 13:21:53','2019-07-25 13:21:53'),(775,1350,'08:00','18:00','Akagera National Park -Kigali','Have early breakfast and prepare to start the trip. Leave for Akagera National Park which is located in the northeastern of Rwanda, along the border with Tanzania. Akagera is Rwandas largest national park, covering 1,122 square kilometers of savannah, mountain and swamp habitat. On arrival to the park, you will do a short game drive for your first animal sightings, and enjoy the beautiful scenery of the park. From the game drive transfer to your accommodation for lunch. In the afternoon you will do a boat safari on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Later, return to the lodge for dinner and overnight at (Akagera Game Lodge).','2019-07-25 13:23:47','2019-07-25 13:23:47'),(776,1351,'06:00','18:00','Akagera National Park -Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch, relax a bit and dive back to Kigali for a beautiful Night City Tour. (Dinner and Overnight at Flame Tree Village)','2019-07-25 13:32:01','2019-07-25 13:32:01'),(777,1352,'08:30','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Huye. We have the opportunity of exploring the National Museum in Huye. After this experience, we continue our drive to Nyungwe top view lodge for (dinner and overnight).','2019-07-25 13:33:25','2019-07-25 13:33:25'),(778,1353,'05:30','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\n\r\nAfter lunch, you will visit canopy walkway before being transferred to karongi. This is a 2hr50min drive from Nyungwe to Karongi where you will Connect to your Hotel for relaxation. (Dinner and Overnight at Kivu Lodge).','2019-07-25 13:35:16','2019-07-25 13:35:16'),(781,1355,'05:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about culture in Village.\r\n (Dinner and Overnight at Mountain Gorilla View Lodge)','2019-07-25 13:38:39','2019-07-25 13:38:39'),(782,1356,'05:30','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive for less than 21minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement.\r\nThey live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting.\r\nAfter the Trek, will head for Lunch and later drive back to your hotel in Kigali (Dinner and Overnight at Flame Tree Village).','2019-07-25 14:00:39','2019-07-25 14:00:39'),(783,1357,'08:30','18:00','KIGALI','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-07-25 14:02:36','2019-07-25 14:02:36'),(784,1358,'08:30','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. \r\n (Dinner and Overnight at Akagera Game Lodge).','2019-07-25 14:27:49','2019-07-25 14:27:49'),(785,1359,'06:00','18:00','Akagera National Park -Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch and relax before being transferred to Volcanoes National Park. This is a 4hr30min drive from Akagera to Musanze where you will Connect to your Hotel for relaxation.   (Dinner and Overnight at Virunga Hotel)','2019-07-25 14:29:05','2019-07-25 14:29:05'),(786,1360,'05:30','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about culture in Village. (Dinner and Overnight at Virunga Hotel)','2019-07-25 14:43:03','2019-07-25 14:43:03'),(787,1361,'05:30','18:00','Volcanoes National Park - Kibuye','Early in the morning you will take breakfast at the Hotel, then drive for less than 21minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement.\r\nThey live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting.\r\nAfter the Trek, will head for Lunch and later drive to Karongi where you will connect to your hotel for relaxation. (Dinner and Overnight at Delta Resort Hotel)','2019-07-25 14:45:17','2019-07-25 14:45:17'),(788,1362,'08:30','18:00','Lake kivu - Nyungwe Top View','Early morning after breakfast, you will do a boat ride at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Karongi to Nyungwe its about 110Km and road takes about 2hours with no rush. (Dinner and Overnight at Peace Guest House)','2019-07-25 14:49:52','2019-07-25 14:49:52'),(790,1364,'08:30','18:00','KIGALI','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-07-25 15:10:42','2019-07-25 15:10:42'),(791,1366,'07:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). \r\nCheck-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.\r\n (Dinner and Overnight at Akagera Game Lodge)','2019-07-29 14:05:39','2019-07-29 14:05:39'),(792,1367,'07:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.\r\n(Dinner and Overnight at Hotel de Mille Collins)','2019-07-29 14:06:49','2019-07-29 14:06:49'),(793,1368,'07:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Huye. We have the opportunity of exploring the National Museum in Huye and the Kings Palace in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway\r\n(Dinner and overnight at Nyungwe top View Hotel).','2019-07-29 14:07:47','2019-07-29 14:07:47'),(794,1369,'05:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hr drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\n(Dinner and Overnight at Moriah Hotel).','2019-07-29 14:09:03','2019-07-29 14:09:03'),(795,1370,'07:00','18:00','Karongi-Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town) (Dinner and Overnight at Kivu Serena Hotel)','2019-07-29 14:10:41','2019-07-29 14:10:41'),(797,1372,'17:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive for less than 21minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive back to your hotel in Kigali.','2019-07-29 14:18:39','2019-07-29 14:18:39'),(804,1389,'08:00','18:00','Rwanda -Congo','Meeting at the border Grande Barrire Rwanda-DRC. Welcoming with our staff at the border. Assisted to clear with formalities. Ensure crossing the border at 10:30 am and check-in with Virunga tourism office by 11:15am which is located in the Grande Barrire border post building, opposite passport control. Once check-in is complete, transfer to Kibumba.','2019-08-17 17:21:32','2019-08-17 17:21:32'),(805,1390,'06:30','18:00','Virunga Park(Congo)','After an early breakfast at Kibumba Tented Camp, trekkers will head down the hill to meet their Ranger guides and have a briefing before the gorilla trek. Treks usually require 1-2.5 hours of hiking each way, depending on location of the gorilla group being trekked and the difficulty of the terrain. After spending the allotted hour with the gorilla family group, trekkers will make their way back to camp, enjoy a late lunch and have the rest of the day at leisure, including time for nature walks and bird watching.','2019-08-17 17:22:37','2019-08-17 17:22:37'),(806,1391,'08:00','18:00','Virunga Park(Congo)','After breakfast in Kibumba, guests will be transported to the Kibati Ranger Post at 8:15am, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, guests will receive a briefing. Park rangers lead all treks and porters (unaffiliated with the park) are available for hire at Kibati ranger station. The time required to reach the summit depends on the average fitness of each group, but typically takes 4  6 hours. It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the worlds largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\nTrekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0C/32  rated sleeping bag), good walking shoes, sun cream, etc.','2019-08-17 17:32:26','2019-08-17 17:32:26'),(807,1392,'07:00','18:00','Virunga Park(Congo) -Rwanda','After a very early morning visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. Average descent time is four hours. Drive back to Goma town. Be transferred back to the border and return to Rwanda, to Kigali International Airport for departure.','2019-08-17 17:33:57','2019-08-17 17:33:57'),(808,1402,'05:30','18:00','Kigali - Uganda (Bwindi National Park)','You will be picked up by our guide from your location in Kigali and proceed to the Rwanda Uganda border crossing at Cyanika. Stop over at Kabalee Town for Lunch and a short tour. After the short tour, you will head out for the Batwa experience. Dinner and Overnight at Rushanga Gorilla Camp.','2019-09-02 13:27:00','2019-09-02 13:27:00'),(809,1403,'05:30','18:00','Bwindi  National Park  - Kigali (Rwanda)','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8:30am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas.In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. Later, drive back to Rwanda-Kigali and be dropped at your desired Location.','2019-09-02 13:32:04','2019-09-02 13:32:04'),(833,1432,'07:00','18:00','Kampala - Jinja','Our 1 Days Jinja city tour, starts from Kampala as early as 7:00am and takes you to visit sites like the Ssezibwa falls, enroute, the Mabira forest for a zip lining activity. You will then proceed to go have lunch in Jinja at Jinja Nile resort near the shores. Later you will visit the source of the Nile. Take a boat to the actual point believed to be the point where the Nile separates from Lake Victoria and then return to the starting point. You will then go visit the Kagulu hills and the Busoga kings palaces, before you start your journey back to Kampala.','2019-09-06 11:28:17','2019-09-06 11:28:17'),(834,1433,'16:00','18:00','KIGALI','You will be received by G-STEP TOURS driver/guide at Kigali International and then Transfer you to Mille Collins Hotel for dinner and Overnight.','2019-09-06 13:53:35','2019-09-06 13:53:35'),(835,1434,'08:00','18:00','Kigali -Nyungwe national park','Early Morning after breakfast, begin your safari from Kigali heading to Nyungwe National park passing to Kings Palace Museum. During a 2-hours drive, you will experience the culture of ancient Rwanda.\r\nDinner and Overnight at Nyungwe Top View Hill Hotel.','2019-09-06 13:55:12','2019-09-06 13:55:12'),(836,1435,'09:00','06:00','Nyungwe National Park','This morning after breakfast, you will go for Canopy Walkway, enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! After Lunch, you will go for colobus Monkeys trek. Dinner and overnight at Nyungwe Top View Hill Hotel.','2019-09-06 14:04:03','2019-09-06 14:04:03'),(837,1436,'05:00','18:00','Nyungwe National Park','After an early breakfast will drive you to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. You will encounter the chimps and many other primates like the black and white monkeys and various bird species. After Lunch Visit Gisakura Tea factory. Dinner and overnight at Nyungwe Top view hill hotel.','2019-09-06 14:05:17','2019-09-06 14:05:17'),(838,1437,'07:00','18:00','Nyungwe National Park -Kibuye','At 700hrs depart Nyungwe forest to Kibuye. The drive is about 1hr with breathtaking hilly view of the land of the thousand hills. On arriving Kibuye, you will go for lunch. After lunch do an evening boat ride and hiking at Lake Kivu. Dinner and Overnight at Kivu Lodge.','2019-09-06 14:06:26','2019-09-06 14:06:26'),(840,1439,'06:00','18:00','Volcanoes National Park','after an early breakfast at your hotel as you prepare for a thrilling experience while gorilla trekking. To the Headquarters of Kinigi with, water plus a light rain jacket for a briefing about the gorilla trekking escapade. In this briefing you will be advised on how you should handle yourself on finding the gorilla, what to carry with you for the trekking and among these will be trekking-boots because the track takes you along the steep slippery grounds in the heart of the forests. The activity of Gorilla trekking is somewhat fatiguing and frustrating however very rewarding when you finally come face to face with these gentle apes. You will be permitted to spend an hour in their presence, taking photos and observing there very impressive way of living. After gorilla trekking drive about 1hour to Burera and Ruhondo Lakes to enjoy a fantastic boat cruise. Dinner and Overnight at Mountain Gorilla View Hotel.','2019-09-06 14:34:05','2019-09-06 14:34:05'),(841,1440,'05:00','18:00','Volcanoes National Park - Kigali','This morning after quick breakfast, you will be at Kinigi reception for breathing about Golden monkeys in Rwanda live in the bamboo vegetation towards the base of the volcanoes and habituation has helped them to overcome their initial shyness to accept their daily visit by researchers and tourists. They are very active creatures, and jump from tree to tree which is really interesting and a little difficult to photograph!The golden monkey trek is worth going for while in Volcanoes National Park and if youre interested in wildlife, this is a rare and delightful experience not to be missed!  Later return to your lodge for lunch and relax. after lunch drive to Kigali.  Dinner and Overnight at Hotel Mille Collines.','2019-09-06 14:43:46','2019-09-06 14:43:46'),(842,1441,'09:30','18:00','Kigali -Akagera National Park','After a morning breakfast Drive to Akagera National park for an evening boat tour on Lake Ihema. Expect to see aquatic animals such as Hippos, lions, Crocodiles as well as water birds like the papyrus gonolek, shoebill stork, and African fish eagle.  Dinner and Overnight at Akagera game lodge.','2019-09-06 14:51:06','2019-09-06 14:51:06'),(843,1442,'06:00','18:00','Akagera National Park -Kigali','After a morning breakfast enjoy a game drive in akagera national park. Expect to encounter some members of the big five including the hippos, elephants, buffaloes, etc.; waterbucks and different antelope species. from here will drive back to Kigali. dinner and overnight at Hotel des Mille Collines','2019-09-06 14:56:13','2019-09-06 14:56:13'),(844,1443,'08:00','18:00','KIGALI','Excursion in Kigali town, Visit the local craft market and late in the evening drive to Kigali International airport in time for your flight back home.','2019-09-06 15:01:11','2019-09-06 15:01:11'),(848,1450,'16:00','18:00','Kilimanjaro International Airport','Arrive at the Kilimanjaro International Airport where you will be met at the airport and be transferred to the Hotel in Moshi for overnight.','2019-09-18 13:51:34','2019-09-18 13:51:34'),(849,1451,'06:00','18:00','Mandara Hut','After breakfast, you will be collected from your lodge in Moshi and taken to the Marangu gate. Once the necessary paper work has been completed, your trek can begin and you will soon be hiking through the dense rainforest. Alongside the impressive vegetation, you will have the chance to catch a glimpse of some primates as you head to the Mandara Hut. After a well-earned rest, your guide can take you to the Maundi Crater where you can enjoy the wonderful view of the Kenyan interior.','2019-09-18 14:34:16','2019-09-18 14:34:16'),(850,1452,'06:00','18:00','Horombo Hut','The day begins with an early breakfast. Shortly after you have left Mandara Hut, you will reach the timberline and then enter the heath and moor zone. Approximately 4  6 hours later, the Horombo Hut will come into sight, standing at an altitude of 3700m. From the hut, you will have fantastic views overlooking Mawenzi, Kibo and the wide plain of the Masai steppe.','2019-09-18 14:36:57','2019-09-18 14:36:57'),(851,1453,'06:00','18:00','Horombo Hut','Today serves as an acclimatization day. This should not be underestimated and greatly improves your chance of success in reaching the summit. After a relaxing breakfast, a 4 hour trek follows to the Zebra Rocks (4020m). The distinctive black and white stripes give the rock formation its name. On your return to Horombo Hut, a warm lunch will be waiting for you. You can relax in the afternoon and regain your strength for the hike the following day.','2019-09-18 14:45:03','2019-09-18 14:45:03'),(852,1454,'06:00','18:00','Kibo Huts','Todays stage is long and tough. The well-built trail passes the Last Water point which is followed by the so-called saddle. This nearly vegetation less plateau joins the main summit Kibo with Mawenzi. Todays destination is the Kibo Hut that is usually reached in about 5 - 6 hours. Here, you will enjoy an early evening meal followed by an early night, as the night will be short.','2019-09-18 14:46:15','2019-09-18 14:46:15'),(854,1456,'06:00','18:00','Marangu Gate','The last stage passes through the heath and moor zone to the Mandara Hut (2700m) where a warm lunch is waiting for you. Soon, you will once again pass the tropical rainforest and after a total time of 6 hours trekking, you will be back at the Kilimanjaro National Park Gate (1860m). After saying goodbye to your mountain guides, a short transfer follows to take you back to your hotel in Moshi. Once there, you can take a warm and relaxing shower and celebrate your success in reaching the summit of the Kilimanjaro.','2019-09-18 14:49:44','2019-09-18 14:49:44'),(859,1474,'15:00','18:30','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative). Depending on your arrival time, if you arrive evening time, you will have small City tour. Check-in and dinner at Kigali Serena Hotel.','2019-10-08 12:05:46','2019-10-08 12:05:46'),(860,1475,'08:00','18:00','Kigali -Nyamata','Start historical-minded exploration of Kigali with visits to landmarks from colonial, post-independence, genocide and post-genocide times i.e. Kigali Solaire, Stade regionale, Kigali Genocide memorial site, Kandt Museum, Belgian camp. From here you will go for lunch at your hotel. In afternoon drive to bugesera to visit the reconciliation village, Nyamata and Ntarama genocide churches. Dinner and Overnight at Kigali Serena Hotel.','2019-10-08 12:06:33','2019-10-08 12:06:33'),(861,1476,'06:00','18:00','Kigali -Akagera National Park','Transfer to Kirehe; visit Imigongo and practice ancient artisanry in the region, watch the waterfalls in Rusumo (Border between Tanzania and Rwanda). After that you will for lunch before being transferred to akagera national park. Dinner and Overnight at Ruzizi Tented Lodge.','2019-10-08 12:07:27','2019-10-08 12:07:27'),(862,1477,'06:00','18:00','Akagera National Park','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch. After lunch you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Ruzizi Tented Lodge.','2019-10-08 12:08:16','2019-10-08 12:08:16'),(863,1478,'08:00','18:00','Akagera National Park -Kigali','This day After breakfast, we shall have yet another day of adventure within the park, enjoying the beautiful sceneries of Rwandas hilly landscape, comprised of a blend of wetland, savannah and woodland, the natural forests also make quite a view. With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm. Dinner and Overnight at Kigali Serena Hotel.','2019-10-08 12:09:14','2019-10-08 12:09:14'),(865,1480,'08:00','06:00','Huye -Nyungwe National Park','Morning after breakfast, visit the ethnographic Museum, introduction to Rwandas kingdoms, discovery of colonial architecture, enjoy traditional dancers from the museum. From here you will go for lunch at your hotel before being transferred to Nyungwe head office for our3pm canopy walk way. Dinner and Overnight at Nyungwe top View Lodge.','2019-10-08 12:11:43','2019-10-08 12:11:43'),(866,1481,'08:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will visit Gisakura Tea Factory. Dinner and Overnight at Nyungwe Top View Lodge.','2019-10-08 12:13:00','2019-10-08 12:13:00'),(867,1482,'08:00','18:00','Nyungwe National Park -Kibuye','Morning After break, you will visit Kamiranzovu swamp. This activity will take 1.5hours The trail has a lot of wildflowers along it and therere non-forest birds- on the way you will have 360degrees view of the park and even see Lake Kivu in the distance. On a clear day, you can even also see the majestic Virunga Volcanoes that seem to tower over Rwanda. From here, you will be driven back to your hotel for lunch. After lunch drive to Karongi. Dinner and Overnight at Kivu Lodge.','2019-10-08 12:18:26','2019-10-08 12:18:26'),(868,1483,'08:00','18:00','Karongi-Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town) Dinner and Overnight at Lake Kivu Serena Hotel.','2019-10-08 12:19:39','2019-10-08 12:19:39'),(869,1484,'08:00','18:00','Gisenyi -Volcanoes National Park','After early morning breakfast or with packed Breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Dinner and Overnight at Ingagi Park View Lodge.','2019-10-08 12:21:46','2019-10-08 12:21:46'),(870,1485,'07:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive  to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Nkotsi Village for Community activities. Dinner and Night at Ingagi Park View Lodge.','2019-10-08 12:23:18','2019-10-08 12:23:18'),(871,1486,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel at 6:30 to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. On your way back you have your lunch, drinks and other necessities at the foot of the mountain. Dinner and Overnight at Ingagi Park View Lodge.','2019-10-08 12:24:06','2019-10-08 12:24:06'),(872,1487,'08:00','18:00','Volcanoes National Park - Kigali','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to musanze for lunch before being transferred to Kigali. Dinner and Overnight at Kigali Serena Hotel.','2019-10-08 12:25:26','2019-10-08 12:25:26'),(873,1488,'08:00','18:00','KIGALI','Souvenir shopping in local handcraft at kimironko markets and transfer to the airport for your departure flight.','2019-10-08 12:26:27','2019-10-08 12:26:27'),(874,1489,'22:30','22:57','KIGALI','Welcome to Rwanda! Meet and greet at Kigali International Airport by your G-STEP TOURS driver/guide. Representative who will greet you with an extra ordinary welcome package demonstrating unique service provision in the land of a Thousand Hills Rwanda. With a cool breeze and well lit Roads. Depending on your arrival time if you arrive evening time you will be transferred to Hill View Hotel& Apartment. for dinner and Overnight, from Kigali international airport to Kigali Serena hotel takes 27minutes.','2019-10-14 11:42:01','2019-10-14 11:42:01'),(875,1490,'09:00','18:00','Kigali -Nyungwe national park','Morning After your Breakfast at9: 00am, we will have small city tour by visiting the 1994 Gisozi memorial site. After that we head south west to the verdant Nyungwe Forest National Park via to Kings royal palace museum Nyanza and Ethnographic museum during a 2-hours drive, you will have to experience the culture and tools of ancient Rwandans. After continue to Nyungwe National Park for Dinner and Overnight.at Nyungwe Top View Hill Hotel.','2019-10-14 11:43:48','2019-10-14 11:43:48'),(876,1491,'05:00','18:00','Nyungwe National Park','After Breakfast which is served from 5 to10am, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest.\r\nTrekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys.\r\n\r\n After lunch, you will visit Kamiranzovu Water Fall. This activity will take 1.5hours The trail has a lot of wildflowers along it and therere non-forest birds- on the way you will have 360degrees view of the park and even see Lake Kivu in the distance. On a clear day, you can even also see the majestic Virunga Volcanoes that seem to tower over Rwanda. From here, you will be driven back to Nyugwe top view hotel for dinner and overnight.','2019-10-14 11:45:16','2019-10-14 11:45:16'),(877,1492,'08:00','18:00','Nyungwe National Park -Kibuye','After breakfast, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds!\r\n After Lunch, you will visit Gisakura Tea Factory before being transferred to Karongi, where you will Connect to your Hotel for relaxation. Dinner and Overnight Moriah Hotel.','2019-10-14 11:46:23','2019-10-14 11:46:23'),(878,1493,'08:30','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi its about 124Km and road takes about 3hours with no rush. Arriving at Gisenyi where we visit Hot spring, visit DRC-Rwanda border (Gisenyi town) Dinner and Overnight at the palm beach Hotel','2019-10-14 11:47:14','2019-10-14 11:47:14'),(880,1495,'06:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast, you will be transferred to the park headquarters in Kinigi. It will take 21 min drive. Register with the office and meet with the assigned range guide and the other hiking members. The ranger gives a small talk about the hiking activity and important information about the park for 7min. You will be getting into the cars and transferring to the starting point of the track which is about 30 to 45minutes of drive Hiking the Mountain Bisoke. The starting point is at an elevation of 2700 meters above sea level, walk through the local communities and the farmland at the edge of the park for about 15minutes before closing the stone wall into the park. Here theres chance to see Mountain Elephants, Buffaloes but it is little chance of the encountering these, so it is just-in-case. After hiking, you will go for lunch later drive back to Kigali for dinner and overnight at Hill View Hotel Apartment','2019-10-14 11:49:17','2019-10-14 11:49:17'),(881,1496,'08:00','18:00','Kigali International airport','After breakfast, proceed to Kigali International Airport for your departure flight.','2019-10-14 11:50:14','2019-10-14 11:50:14'),(882,1497,'15:00','18:00','KIGALI','On arrival at Kigali international airport, you will be welcomed by our company representative together with your driver / guide and depending on the time of your arrival, you will go for a short city tour within Kigali and visit the Kigali genocide memorial site. Dinner and overnight stay at Mille Collines Hotel.','2019-10-14 12:53:24','2019-10-14 12:53:24'),(883,1498,'09:00','18:00','Kigali -Volcanoes National Park','Enjoy breakfast and enjoy another stroll around Kigali city where you will visit the Kimironko market and mingle with the locals and after transfer to Ruhengeri in the Northern Province driving on a smooth tarmac road. The park is well known for its rare mountain gorillas making Gorilla trekking the major tourism activity. Arrive Ruhengeri late afternoon and transfer to your lodge for dinner and overnight at Mountain Gorilla View Lodge','2019-10-14 12:54:48','2019-10-14 12:54:48'),(884,1499,'06:00','18:00','Volcanoes National Park','After early morning breakfast or with packed Breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Dinner and Overnight at Mountain','2019-10-14 12:58:46','2019-10-14 12:58:46'),(885,1500,'05:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive for less than 21minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch later drive to Nkosti Village (Red Rocks) for community activities on which include; Basket weaving, V Bee Keeping, Drumming Lessons. Dinner and Overnight at Mountain Gorilla View Lodge','2019-10-14 13:00:20','2019-10-14 13:00:20'),(886,1501,'09:00','18:00','Volcanoes National Park - Gisenyi','After breakfast, you will drive to Burera and Ruhondo Lakes to enjoy a fantastic nature walk around the lakes, bird watching, and later a beautiful sundowner cruise while enjoying the outstanding view of the volcanoes with cold drinks and snacks. Later in the evening, drive to Gisenyi for relaxation. Dinner and Overnight at Kivu Serena Hotel.','2019-10-14 13:01:32','2019-10-14 13:01:32'),(888,1503,'08:00','18:00','Nyungwe National Park','After breakfast, you will drive to Nyungwe national park for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic Views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! After canopy adventure you will go for dinner and overnight at Nyungwe Top View Lodge.','2019-10-14 13:03:52','2019-10-14 13:03:52'),(889,1504,'05:00','18:00','Nyungwe National Park - Huye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will drive to Huye for Overnight and Dinner at Beausejour Hotel.','2019-10-14 13:05:03','2019-10-14 13:05:03'),(890,1505,'08:30','18:00','Huye -Kigali','Morning After breakfast, you will visit Ethnographic Museum in Huye. This Museum will provide you with more information about the Rwandas history and culture. Return to your hotel for lunch after lunch you will visit Kings palace in Nyanza. Later drive to Kigali for dinner and overnight at Mille Collines Hotel.','2019-10-14 13:06:11','2019-10-14 13:06:11'),(891,1506,'06:00','18:00','Kigali -Akagera National Park','Have your breakfast and drive to Akagera National Park. Driving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Akagera Game Lodge.','2019-10-14 13:07:26','2019-10-14 13:07:26'),(892,1507,'09:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.\r\nDinner and Overnight at Hotel de Mille Collins','2019-10-14 13:08:47','2019-10-14 13:08:47'),(893,1508,'08:00','18:00','Kigali International airport','Have breakfast and transfer to the airport for your departure flight.','2019-10-14 13:10:08','2019-10-14 13:10:08'),(898,1513,'18:00','18:30','KIGALI','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to the Hill View Hotel for overnight and dinner.','2019-10-14 14:45:40','2019-10-14 14:45:40'),(899,1514,'06:00','18:00','Akagera National Park','Have early breakfast and prepare to start the trip. Leave for Akagera National Park which is located in the northeastern of Rwanda, along the border with Tanzania. Akagera is Rwandas largest national park, covering 1,122 square kilometers of savannah, mountain and swamp habitat. On arrival to the park, you will do a short game drive for your first animal sightings, and enjoy the beautiful scenery of the park. From the game drive transfer to your accommodation for lunch. In the afternoon you will do a boat safari on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Later, return to the lodge for dinner and overnight at (Akagera Game Lodge).','2019-10-14 14:47:02','2019-10-14 14:47:02'),(900,1515,'06:00','18:00','Akagera National Park -Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch, relax a bit and dive back to Kigali for a beautiful Night City Tour. (Dinner and Overnight at Hill View Hotel)','2019-10-14 14:47:46','2019-10-14 14:47:46'),(901,1516,'08:00','18:00','Kigali International airport','After breakfast, proceed to Kigali International Airport for your departure flight.','2019-10-14 14:48:40','2019-10-14 14:48:40'),(902,1517,'09:00','18:00','Kigali -Volcanoes National Park','Upon arrival, you will be welcomed by your G-STEP TOURS driver/guide, briefed about Rwanda Cycling Tour and drive north of Rwanda to Volcanoes National Park, viewing the spectacular scenery of the Virunga Mountains en route. Dinner and overnight stay at Classic Resort Hotel.','2019-10-14 15:13:06','2019-10-14 15:13:06'),(903,1518,'07:00','18:00','Volcanoes National Park','Begin your day with breakfast early and with your cyclist guide, you will cycle towards the twin lakes close to the border of Rwanda  Uganda namely Lake Burera and Lake Ruhondo. The cycling tour will take you through different small villages where you will have extended time interacting with the locals is this is of interest to you. You will arrive at the twins lakes and order for your lunch before exploring the area further with a short hike. Dinner and Overnight at Ruhondo Beach Resort.','2019-10-14 15:14:19','2019-10-14 15:14:19'),(904,1519,'07:00','18:00','Volcanoes National Park - Kigali','After your breakfast, you will start the cycling trip with a stopover at one of the biggest swamps in Rwanda called Rugezi swamp in case you missed it the previous day. For those who are interested in birds, you may have a few minutes to sight some birds before continuing on the trip.  Enjoy the scenery one last time before starting the journey back to Musanze. Dinner and Overnight at Classic Resort Hotel','2019-10-14 15:15:17','2019-10-14 15:15:17'),(905,1520,'07:00','18:00','KIGALI','After breakfast, you will pack up and begin your journey back to Kigali. Upon reaching Kigali, you will go for a Kigali city tour. You may also visit the genocide memorial site at Kigali. Thereby ending your 4 days Rwanda cycling tour. Your Guide will thereafter take you back to your hotel or Airport.','2019-10-14 15:18:48','2019-10-14 15:18:48'),(906,1521,'15:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). \r\nCheck-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.\r\n (Dinner and Overnight at Akagera Game Lodge)','2019-10-16 09:40:21','2019-10-16 09:40:21'),(907,1522,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.\r\n(Dinner and Overnight at Hotel de Mille Collins)','2019-10-16 09:41:16','2019-10-16 09:41:16'),(908,1523,'08:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the Kings Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway (Dinner and overnight at Nyungwe top View Hotel).','2019-10-16 09:42:09','2019-10-16 09:42:09'),(909,1524,'05:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 2hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\n(Dinner and Overnight at Kivu Lodge).','2019-10-16 09:43:13','2019-10-16 09:43:13'),(910,1525,'08:00','18:00','kibuye-Volcanoes National Park','This Morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Musanze. The distance from Karongi to Musanze is about 187Km, which takes about 4hrs drive with no rush. (Dinner and Overnight at Ingagi Park View Lodge)','2019-10-16 09:51:00','2019-10-16 09:51:00'),(912,1527,'08:00','18:00','Bwindi Impenetrable National Park','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. Later, drive back to Rwanda-Kigali. (Dinner and Overnight at Hotel de Mille Collins','2019-10-16 09:56:13','2019-10-16 09:56:13'),(913,1528,'08:30','18:00','Kigali International airport','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight','2019-10-16 09:57:12','2019-10-16 09:57:12'),(915,1532,'07:00','18:00','Kigali - Uganda (Bwindi National Park)','You will be picked up by our guide from Kigali and proceed to the Rwanda-Uganda border crossing at Cyanika.\r\nStop over at Kisoro Town for Lunch and a short tour of the small border Town. After the short tour, Leave Kisoro Town to your accommodation in Bwindi.\r\n(Overnight and Dinner at Rushanga Gorilla Camp)','2019-10-16 11:20:26','2019-10-16 11:20:26'),(916,1533,'07:30','18:00','Mbwindi Impenetrable National Park','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience.\r\nAt 8:30am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. \r\nThe Trekking exercise can take between 1-8 hours depending on the movements of the gorillas.\r\nIn the afternoon after trekking, head back to the hotel for Lunch and some relaxation.\r\nIn the evening, head out for the Batwa experience. After that, return to your Hotel For dinner and overnight.','2019-10-16 11:22:03','2019-10-16 11:22:03'),(917,1534,'08:00','18:00','Uganda -Rwanda','After breakfast, embark on your drive back to Rwanda via Lake Burera and Lake Ruhondo where you will do a boat ride on the lake where you will enjoy the beauty of the twin lakes and lots birds.\r\nLater in the evening, drive back to Kigali and be dropped at your desired location.','2019-10-16 11:27:29','2019-10-16 11:27:29'),(918,1535,'03:00','18:00','Rwanda - Uganda','Our tour guide will pick you from a hotel in Kigali and cross you over to Uganda through Katuna Immigration boarder point to the northern sector of Bwindi impenetrable Forest national park. This scenic drive will take approximately 3 hours at a speed of 60KM/hr. Check-in the Hotel on arrival and have some good rest. (Dinner and Overnight at Icumbi Gorilla Safari Lodge)','2019-10-16 13:54:20','2019-10-16 13:54:20'),(919,1536,'07:00','18:00','Bwindi Impenetrable National Park','Have an early breakfast and head to the park headquarters for briefing from the park rangers about the dos and donts while with the gorillas. Proceed for the memorable adventure penetrating the impenetrable forest in search for the gentle giants. This may take 2-8 hours depending on the movement of the animals. You will spend a maximum time of one hour enjoying the gorillas play, feed or rest while taking your observations and photographs. After lunch, you will go for Batwa experience. where you will be entertained and given tales of their unique culture. Dinner and overnight at Icumbi Gorilla Safari  Lodge.','2019-10-16 13:55:36','2019-10-16 13:55:36'),(920,1537,'07:00','18:00','Bwindi Impenetrable National Park','Just like the previous day, you will have an early morning breakfast and transfer to the park headquarters for briefing. You will probably trek a different gorilla family but all following different trails. Dinner and overnight at Icumbi Gorilla Safari Lodge.','2019-10-16 13:57:15','2019-10-16 13:57:15'),(921,1538,'08:00','18:00','Uganda -Rwanda','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at your hotel or at the airport for your scheduled flight back home.','2019-10-16 13:58:15','2019-10-16 13:58:15'),(922,1539,'15:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali.  Dinner and Overnight stay at Mille Collins Hotel.','2019-10-17 15:03:01','2019-10-17 15:03:01'),(923,1540,'08:00','18:00','Volcanoes National Park - Uganda','After breakfast, drive to ibyiwacu cultural village in Musanze to learn about the Rwandan culture and traditions. After lunch you will drive to Uganda, check-in at Bunyonyi Safari Lodge for Dinner and Overnight.','2019-10-17 15:03:54','2019-10-17 15:03:54'),(924,1541,'08:00','18:00','Lake Bunyonyi -Bwindi national park','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to bwindi impenetrable national park. Dinner and Overnight at Icumbi Gorilla Safari Lodge','2019-10-17 15:05:41','2019-10-17 15:05:41'),(925,1542,'07:00','18:00','Bwindi National Park -Kigali','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. After lunch drive back to Kigali and be dropped at mille Collins hotel for dinner and overnight.','2019-10-17 15:07:38','2019-10-17 15:07:38'),(926,1543,'08:00','18:00','Kigali International airport','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight','2019-10-17 15:08:41','2019-10-17 15:08:41'),(927,1544,'15:00','18:00','Kigali -Volcanoes National Park','This tour starts with an early morning pickup by our company representative from either a hotel / Kigali International Airport for a transfer to Volcanoes National Park, Musanze province\r\nOn your way, engage in a Kigali City Tour taking you through Gisozi Genocide Memorial Site before proceeding with your drive to the park. On arrival, proceed to your lodge check in; Dinner and overnight at Le Bambou Gorilla Lodge','2019-10-18 14:49:53','2019-10-18 14:49:53'),(928,1545,'07:00','18:00','Volcanoes National Park - Uganda','After breakfast, visit I byiwacu cultural village to learn Rwandan culture and traditions. After lunch, you will drive to Burera and Ruhondo Lakes to enjoy a fantastic nature walk around the lakes, bird watching, and later a beautiful sun downer cruise while enjoying the outstanding view of the volcanoes with cold drinks and snacks. Later processed to Uganda- Bwindi impenetrable national park. Dinner and Overnight at Gorilla Safari Lodge','2019-10-18 14:57:10','2019-10-18 14:57:10'),(929,1546,'07:00','18:00','Bwindi Impenetrable National Park','Rise early, enjoy breakfast and proceed to the Bwindi Park offices by 7:00AM; just in time for the morning briefing on the code of conduct when trekking for the mountain gorillas. After locating the creatures, take clear observation of their behavior while taking photographs and videos for this wonderful encounter. Later retrieve the starting point; meet up your guide for a drive back to your lodge. In the evening, step out for a visit to the Batwa Pygmies Community where you will learn more about their cultural practice. Dinner and Overnight at Gorila Safari Lodge.','2019-10-18 15:02:07','2019-10-18 15:02:07'),(930,1547,'08:00','18:00','Queen Elizabeth National Park','Following your breakfast, you will set off for Queen Elizabeth NP; driving through the Ishasha sector; watching out for the unique tree climbing lions. On arrival, check in at your lodge and later step out for an evening Game drive through the savannah grassland before retiring at your lodge.\r\nDinner and rest at Mweya Safari Lodge','2019-10-18 15:04:13','2019-10-18 15:04:13'),(931,1548,'08:00','18:00','Queen Elizabeth National Park','Rise early, for a game drive in the savanna of queen Elizabeth national park with great views of wildlife in the park.\r\nFollowing your lunch, have a wonderful Launch Cruise on the Kazinga Channel where you will be rewarded with spectacular views of diversified wildlife species as they graze and drink near the Kazinga Channel area like the hippopotami, crocodiles, elephants, and Impalas among others. Dinner and Overnight at Mweya Safari Lodge.','2019-10-18 15:05:23','2019-10-18 15:05:23'),(933,1550,'09:00','18:00','Kigali International airport','Souvenir shopping in local handcraft at kimironko markets and transfer to the airport for your departure flight','2019-10-18 15:09:37','2019-10-18 15:09:37'),(938,1555,'05:00','19:00','Volcanoes National Park','You will be picked up from our office Remera  Kisimenti and then drive to Volcanoes National Park, Musanze.\r\nReaching the Kinigi Park Offices by 7:00 AM just in time for the morning briefing and registration before proceeding to the head trail  the Mt Bisoke hike starting point. With packed lunch and hiking gear,\r\nWith your guides and porters start hike to the top of this volcano, enjoy lunch uphill before retrieving the starting point; meet up with your guide for drop off at either a hotel / Kigali International Airport.','2019-10-21 11:57:27','2019-10-21 11:57:27'),(941,1557,'05:00','19:00','Akagera National Park','Early in the morning, meet our driver guide, greet and briefing about the tour. Then drive to Akagera national park. We will have a day drive crossing the whole park from south to the north seeing animals around, the park is characterized by woodland, swamps, low mountains and Savannah. The varied terrain shelters wildlife including zebras, giraffes, elephants, lions and hundreds of bird species, such as the rare shoebill stork in the southern part of the park. The vast Lake Ihema is home to hippos and crocodiles. You will enjoy your packed lunch at the Hippo beach in the middle of Akagera National Park, and later drive back to kigali.','2019-10-21 13:00:52','2019-10-21 13:00:52'),(942,1558,'09:00','18:00','Kigali -Akagera National Park','You will be picked up from our office Remera/ Kisimenti  and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive). On arrival at the park, we shall have Lunch and short rest. In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Akagera Game Lodge.','2019-10-21 14:01:39','2019-10-21 14:01:39'),(943,1559,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed breakfast at your hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.','2019-10-21 14:03:05','2019-10-21 14:03:05'),(946,1564,'05:00','18:00','Kigali -Volcanoes National Park','You will be picked up from G-STEP TOURS Office at Kisemeti by your driver/guide then head to Volcanoes National park-home to the remaining mountain gorillas in the world, connect directly to the park headquarters for a briefing about the activity as early as 7am, you will then be allocated the ranger guides and you head for the hike. \r\nKarisimbi volcano is the highest of the 8 mountain peaks of Virunga conservation region (Nyiragongo and Nyamuragira volcanoes). The hike is strenuous and challenging so you need to be physically fit to do this hike. \r\n\r\nThis is a 6 hours hike with great views, different bird species and primates. On reaching at an altitude of about 3700m, you will stop at the first camping site where you will spend a night.','2019-10-21 14:31:02','2019-10-21 14:31:02'),(947,1565,'06:00','18:00','Volcanoes National Park - Kigali','After early breakfast, embark on an hours hike to the summit. At this level the hike is very steep going through trials of thick jungles surrounded by a stunning scenery. \r\nOn reaching at the summit, enjoy amazing views of the surrounding areas like mount Muhabura. After enjoying your time at the summit descent to the starting point where you will meet your driver readily waiting to receive you and connect for late lunch (Self sponsored), Later embark on your journey back to Kigali city.','2019-10-21 14:33:05','2019-10-21 14:33:05'),(948,1566,'08:00','18:00','Kigali -Nyungwe national park','You will be picked up from our office Remera/Kisimenti and then drive to the western province, on your way visit the Royal Palace Museum in Southern Province and later head for an en-rooted lunch in Huye. After lunch you head to Nyungwe National Park for a canopy walk and return in the afternoon for dinner and overnight stay at Peace Guest House.','2019-10-22 11:42:41','2019-10-22 11:42:41'),(949,1567,'07:00','18:00','Nyungwe National Park -Kigali','Morning After break, you will visit Karamazovu  swamp. This activity will take 1-5hours The trail has a lot of wildflowers along it and therere non-forest birds- on the way you will have 360degrees view of the park and even see Lake Kivu in the distance. On a clear day, you can even also see the majestic Virunga Volcanoes that seem to tower over Rwanda. After Lunch you will drive back to Kigali.','2019-10-22 11:46:12','2019-10-22 11:46:12'),(950,1568,'13:00','18:00','Kigali -Akagera National Park','You will be picked up from Office Kisimenti/Remera at 1:00pm and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). On arrival at the park, we shall have a short game drive. Later driver to your hotel for dinner and overnight at Akagera Game Lodge.','2019-10-22 12:11:59','2019-10-22 12:11:59'),(951,1569,'06:00','18:00','Akagera National park - Musanze','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. You will enjoy your packed lunch at the Hippo beach in the middle of Akagera National Park, and later drive to Volcanoes National park. Overnight and dinner at Muhabura Hotel.','2019-10-22 12:20:45','2019-10-22 12:20:45'),(952,1570,'05:00','18:00','Volcanoes National Park - Gisenyi','Early morning breakfast, transfer to the park headquarters for briefing from the park warden about the endangered golden monkeys. After connect to the tracking starting point and enter the forest to search for the rare golden monkey. This activity can take about 1-5 hours and is done at closer view of the other primates in the park like the red tailed monkeys, Velvet monkeys among other. After viewing the rare golden monkeys for an hour while taking pictures and studying their behaviors. After Lunch and short rest, drive to Gisenyi . Dinner&Overnight at  Ubumwe Hotel Gisenyi.','2019-10-22 12:30:30','2019-10-22 12:30:30'),(953,1571,'09:00','18:00','Gisenyi-Kigali','Morning  after breakfast, you will go for boat ride enjoying the beautiful water, Visit Rubona Peninsula, Hot springs and see the amazing bird life, engage with friendly communities and do something unique in almost all of Africa. Later back to your hotel for lunch and relax, after lunch you will drive back to Kigali.','2019-10-22 12:32:14','2019-10-22 12:32:14'),(954,1572,'06:00','18:00','Kigali -Akagera National Park','You will be picked up by our company representative from your Hotel or Kigali International Airport for a road trip to Akagera National Park.\r\nDriving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema.  At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Akagera Game Lodge.','2019-10-22 13:36:10','2019-10-22 13:36:10'),(955,1573,'06:00','18:00','Akagera National Park -Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the Savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. You will enjoy your packed lunch at the Hippo beach in the middle of \r\nand dive back to Kigali for a beautiful Night City Tour. Dinner and Overnight at Great Apartment Hotel.','2019-10-22 13:40:22','2019-10-22 13:40:22'),(956,1574,'08:00','18:00','Kigali -Nyungwe national park','Enjoy an early morning breakfast and then head South West to the verdant Nyungwe Forest National Park via the Kings royal palace museum Nyanza \r\nDuring a 2-hours drive, you will experience the culture of ancient Rwandans. After the stopover, will continue to the Uwinka overlook to be briefed and proceed with your guide to the canopy walk adventure. \r\nThe first 200m is a walk along the forest trail under the thick canopies for an opportunity of viewing the ground level nature before taking on the canopy walk-way to get to the top level of the forest. \r\nThe prominent sightings here include; The blue monkeys, LHoests monkeys, black and white colobus, the red tailed monkeys and the birds. \r\n	Remember to carry a rain coat and hiking shoes but both can be rented from the reception Canter. \r\n	The walking sticks are provided free of charge. \r\n	The minimum age for this walk is 6 years and the kids must be escorted by the adults.\r\n	This canopy walk takes close to 2 hours.\r\nDinner and Overnight at Gisakura Guest House.','2019-10-22 13:43:01','2019-10-22 13:43:01'),(957,1575,'05:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch and in the evening time drive to Karongi.\r\nThis is 1hr50min drive from Nyungwe to Karongi, Connect to your Hotel in karongi for relaxation, dinner and overnight Delta Hotel.','2019-10-22 13:44:38','2019-10-22 13:44:38'),(958,1576,'08:00','18:00','Kibuye -Kigali','Early morning after Breakfast, you will visit the Environmental museum where you will see Traditional herbal medicines and Animal photo displays plus others.\r\nFrom here you will do a boat ride in lake kivu visiting Amahoro Island, Inyenyeri Island, Napoleon Island.\r\nAfter enjoying kivu lake, you will go for lunch and later drive back to Kigali.','2019-10-22 13:49:27','2019-10-22 13:49:27'),(959,1586,'03:00','18:00','Volcanoes National Park','You will be received by G-STEP TOURS driver/guide at the Airport, and drive north-wards through the beautiful terraced hillsides that characterize much of Rwanda\'s landscape, gradually climbing to the base of the awesome volcanoes with about five peaks visible. It is just 2-3 hours drive from Kigali. Settle into Classic Lodge for dinner and overnight.','2019-10-23 11:25:50','2019-10-23 11:25:50'),(960,1587,'06:00','18:00','Volcanoes National Park','Wake-up early and prepare yourself for todays incredible experience of gorilla tracking. \r\nYou will transfer to Kinigi Headquarters for briefing about Gorilla tracking. You are advised to wear trekking boots because tracking goes through steep and slippery jungle grounds of the forest. Gorilla tracking is strenuous and tiresome but meeting and staying with these giant apes is worth the effort. You will be allowed to stay with gorillas for 1 hour for observation and photographing.  Later return to your Hotel for lunch and relax. In Evening you will take Community walk around the area. Dinner and Overnight at  Classic Lodge.','2019-10-23 11:27:28','2019-10-23 11:27:28'),(961,1588,'03:00','18:00','Kigali -Nairobi','Depart for Kigali after breakfast and depending on our flight schedule, we can take a city tour in Kigali, visit the genocide memorial sites, art and crafts shops and local markets, do shopping . After lunch proceed to the airport for your flight to Nairobi. Dinner and Overnight atNairobi Upper Hill Hotel.','2019-10-23 11:54:34','2019-10-23 11:54:34'),(962,1589,'06:00','18:00','Nairobi - Masai Mara National Park.','Have breakfast and hit the road across the Great Rift Valley, where traditional Masai settlements and lakes, inhabited by thousands of flamingos, dot the valley floor. Arrive by afternoon in the famed Mara and venture into the Masai Mara Game Reserve for our first game drive and wildlife encounters. Dinner and overnight at Mara Chui Resort.','2019-10-23 12:11:25','2019-10-23 12:11:25'),(963,1590,'06:00','18:00','Masai Mara National Park','Early breakfast followed by game viewing drive in the Masai Mara plains in search for the Big Five  leopard, lion, elephant, rhino and buffalo  as well as numerous grazing animals such as wildebeest, zebra and giraffe. Also includes good stocks of hippo and crocodile in the Mara River and an enormous variety of birds. The Mara encompasses many peoples ideal of Africa: rolling green hills, vast open horizons and plains stocked with wildlife. Dinner and Overnight at  Mara Chui Resort.','2019-10-23 12:21:36','2019-10-23 12:21:36'),(965,1592,'15:00','18:00','Arusha (Tanzania)','Land in Kilimanjaro International Airport and meet a driver guide who will transfer you to your respective hotel/lodge in Arusha. On arrival, check in at Kibo Palace Hotel where you will spend a night.','2019-10-23 12:52:16','2019-10-23 12:52:16'),(966,1593,'06:00','18:00','Lake Manyara National Park','Have breakfast early in the morning and after, drive to Lake Manyara National Park. Have a stopover in village markets and lunch at the lodge. Later in the afternoon, set off for game drive to view wildlife species like the tree climbing lions. Later, return to the lodge for overnight stay at Lake Manyara Kilimamoja Lodge.','2019-10-23 13:23:07','2019-10-23 13:23:07'),(967,1594,'06:00','18:00','Ngorongoro Crater','Early in the morning, you will be served breakfast and later, set off to Ngorongoro Crater a game drive. Ngorongoro Crater is a home to over 30000 wildlife species and a game drive at the crater rewards you with views of the black rhinos, zebras, hippos, eland, buffaloes, warthogs, lions, leopards, cheetah and jackals. Later, drive back to the lodge for overnight at Ngororo Serena Safari Lodge.','2019-10-23 13:24:42','2019-10-23 13:24:42'),(968,1595,'06:00','18:00','Tarangira National Park','After breakfast, you will transfer to Tarangire National Park. Have lunch at Tarangire Safari Lodge while catching clear views of the surrounding area. After, head for game drive which will reward you with amazing views of leopards, lions, elephants and avian species. After, return to the lodge for night stay at Roika Tarangira Tented Lodge.','2019-10-23 13:29:14','2019-10-23 13:29:14'),(969,1596,'06:00','18:00','Tarangira National Park -Arusha','Have breakfast early in the morning and embark on a journey to Arusha and have overnight stay at Kibo Palace Hotel.','2019-10-23 13:30:23','2019-10-23 13:30:23'),(971,1598,'06:00','18:00','Volcanoes National Park','After breakfast in the morning you will be transferred to the park headquarters for briefing from the park officials on general conduct in the forest as you look out for the group mountain gorillas. Your trek can be 1 to 8 hrs depending on the location of the gorillas, nature of the terrain and your physical fitness. You will have only one hour of face to face encounter with these apes in the wild and after return for dinner and overnight stay in Ingagi Park View Hotel.','2019-10-23 13:35:33','2019-10-23 13:35:33'),(972,1599,'07:00','18:00','Volcanoes National Park - Kigali','Early in the morning, you will have breakfast at the lodge and after the driver guide will transfer you to Kigali for a short city tour at Gisozi genocide memorial site and after set off to the airport for departure and this marks the end of your 8 days safari.','2019-10-23 13:38:14','2019-10-23 13:38:14'),(973,1600,'15:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative). Depending on your arrival time, if you arrive evening time, you will have small City tour. Check-in and dinner at Kigali Serena Hotel.','2019-10-25 12:12:07','2019-10-25 12:12:07'),(974,1601,'08:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the Kings Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway. Dinner and overnight at Nyungwe top View Hotel.','2019-10-25 12:12:47','2019-10-25 12:12:47'),(975,1602,'05:00','18:00','Nyungwe National Park -Bujumbura','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will drive to Bujumbura city; arrive in the evening to relax, and have dinner at Club du lac Tanganyika Hotel.','2019-10-25 12:13:58','2019-10-25 12:13:58'),(976,1603,'08:00','18:00','Burundi','Early morning after breakfast take a visit to the Source of Nile, drive to Rutana to admire Karera waterfalls; later you will visit the Source of the River Nile at Rutovu, a not-so-small forest with a river stream that several researchers, including the BBC, have corroborated to be the Source of the River Nile, the longest river in Africa and second-longest in the world. Dinner and Overnight at Club du lac Tanganyika Hotel.','2019-10-25 12:14:51','2019-10-25 12:14:51'),(977,1604,'08:30','18:00','Burundi','After breakfast, you will drive to Gishora drum sanctuary and visit the Burundi National museum, visit Mushasha catholic village and later continue to the ancient administrative offices during colonial time, then after return to your hotel for dinner and overnight','2019-10-25 12:15:40','2019-10-25 12:15:40'),(979,1606,'09:00','18:00','Kigali International airport','Souvenir shopping in local handcraft at kimironko markets and transfer to the airport for your departure flight.','2019-10-25 12:17:24','2019-10-25 12:17:24'),(981,1611,'08:00','18:00','Burundi','You will be picked from the airport, have a half day tour in Bujumbura for a cultural safari. Then drive to Rusizi National Park for a boat cruise in Rusizi river, views such as hippos, birds and the joining point between Rusizi River and Lake Tanganyika.\r\nContiue for rewards of the belvedere hikes offering a beautiful view of Bujumbura city and independence hero monument. You will also visit explorers memorial, a huge rock in the suburbs of Bujumbura commemorating the meeting between Stanley and Livingstone. Overnight and Dinner at Club du Tanganyika','2019-10-25 16:54:26','2019-10-25 16:54:26'),(982,1612,'08:00','18:00','Burundi','Have breakfast and head to the source of Nile, near the Karera falls. You will enjoy the magnificent tea plantations and admire the scenic land scape.Then later visit waterfalls and after, drive to Gitega town the second town and colonial capital of Burundi. You will also visit Gitega national Museum with its collection of art crafts, Gitega city administrative offices, catholic location of Mushasha and its also different local schools. Dinner and Overnight at Helena Hotel.','2019-10-25 16:56:53','2019-10-25 16:56:53'),(983,1613,'08:00','18:00','Burundi','Have breakfast and visit the famous drum sanctuary site of Gishora-Gishora in Burundi. The site also houses two ritual drums that were never beaten. The Ruciteme and Murimirwa respectively. These two names are intimately linked to the farming vocation and also refer to fertility in the local language, the kings characteristic. You will after visit the drum sanctuary of Gishora to explore the cultural tradition of Burundi. Have lunch at Gitega and after take a city tour around Gitega the second largest town of the country, with much colonial architecture which also hosts the national museum with its ethnographic and archeological collections. Later, have Lunch and drive to Bujumbura. Club du lac Hotel.','2019-10-25 16:58:13','2019-10-25 16:58:13'),(984,1614,'08:00','18:00','Bujumbura','Have a leisurely breakfast and proceed to the Airport for flight connections back home.','2019-10-25 16:59:05','2019-10-25 16:59:05'),(1028,1682,'05:30','19:30','Kigali -Nyungwe national park','You will be picked up from your location in Kigali and then drive to Nyungwe national park. Driving South West of Rwanda (4 hours drive). upon arrival in Nyungwe we shall have a registration at the park entrance and later we shall be briefed about the park and the canopy walk. On the canopy walk you will see the many primates like Ihoest monkeys, red tailed monkeys, many vervet monkeys, grey cheeked monkeys, olive baboons and plant species like the common Igishigishi. After the canopy adventure we shall then hike back to the reception and drive to KCCEM for lunch &short rest. later drive back to Kigali.','2019-11-05 10:49:32','2019-11-05 10:49:32'),(1083,1746,'06:00','18:00','Kampala','Upon arrival at Entebbe Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel for a welcome meal, briefing about this great adventure tour. Dinner and Overnight at Wild Waters Lodge.','2019-11-07 11:39:15','2019-11-07 11:39:15'),(1084,1747,'07:00','18:00','River Nile  Kampala City Tour.','After breakfast, take a boat ride to the source of the Nile a-quite beautiful place, filled with palm trees and fantastic tropical plants. You will take a Boat ride to the actual source of the river Nile and beyond the lake where you will take pictures for future memories. After lunch you will drive to Kampala where you will visit Gaddafi Mosque, Uganda Museum, Kassubi Museum. Dinner and Overnight at Kampala Sheraton Hotel.','2019-11-07 11:40:12','2019-11-07 11:40:12'),(1085,1748,'07:00','18:00','Kampala - Kibale National Park','After enjoying your breakfast, your guide will drive you to Kibale National Park, this park is located in the southern part of Uganda and its a rain forest park covering a size of 766km2 with an altitude of 1, 1100-1600m above sea level. The park has got over 13 primate species including the chimpanzees, 250 tree species, 325 bird species, 13 species of primates, and 60 mammal species. \r\nAlong the way, you will stop at the equator to enjoy some photos and also have your lunch at Mbarara town, after proceed to the park arriving in the afternoon, check in at your lodge and after the park ranger will accompany you to the park in order to enjoy a guided nature walk. You will have a chance to view many animal species like the elephants, monkeys, birds and many more. Later after the nature walk, return to the lodge to have your dinner and an overnight at Dinner and Overnight at Crater Safari Lodge.','2019-11-07 11:41:12','2019-11-07 11:41:12'),(1086,1749,'06:00','18:00','Chimps tracking - Queen Elizabeth N.P','After breakfast, you will be transferred to the park headquarters for the briefing from the senior park ranger and at 8.00 am your guide will transfer you to the starting point for chimpanzee tracking . Normally the whole activity takes less than 4 hours. Later the guide will lead you to Lodge for lunch. In the afternoon transfer to Queen Elizabeth national park. It takes 2 hours to get to Queen Elizabeth national park. Dinner and Overnight stay at Mweya Safari','2019-11-07 11:42:28','2019-11-07 11:42:28'),(1087,1750,'07:00','18:00','Queen Elizabeth National Park','Wake up early for breakfast at 6.30am and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. Overnight stay at Mweya Safari Lodge.','2019-11-07 11:43:23','2019-11-07 11:43:23'),(1088,1751,'06:00','18:00','Queen Elizabeth N.P - Rwanda V.N.P','Have breakfast at leisure and embark on your journey to Rwanda crossing through Cyanika or Katuna boarder and arriving Musanze in the afternoon. Dinner and overnight at Bisate Lodge.','2019-11-07 11:44:57','2019-11-07 11:44:57'),(1089,1752,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. (Dinner and Overnight at Bisate Lodge)','2019-11-07 11:46:13','2019-11-07 11:46:13'),(1090,1753,'07:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive  to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Kigali. Dinner and Overnight at the Retreat by Heaven.','2019-11-07 11:47:06','2019-11-07 11:47:06'),(1091,1754,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-07 11:47:59','2019-11-07 11:47:59'),(1092,1755,'06:00','18:00','Kigali','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to the Onomo Hotel for overnight and dinner.','2019-11-07 12:27:04','2019-11-07 12:27:04'),(1093,1756,'07:00','18:00','Kigali  Nyungwe National Park.','This morning we depart from Kigali to Nyungwe National Park En-route we shall visit the Old Kings Place Museum in Nyanza and National museum (Ethnographic museum) in Huye. Lunch en-route, proceed to the park. Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-07 12:28:52','2019-11-07 12:28:52'),(1094,1757,'05:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-07 12:30:03','2019-11-07 12:30:03'),(1095,1758,'06:00','18:00','Nyungwe National Park - Karongi','Breakfast, with your packed lunch move for a full day forest guided walk within Nyungwe Forest National Park. On this long walk, you will visit the Kamiranzovu waterfalls where you will enjoy your picnic lunch. On this walk expect to see a lot of bird species and also primates like monkeys among others. Later you will Drive to Korongi. Dinner and overnight at Moriah Hotel.','2019-11-07 12:35:26','2019-11-07 12:35:26'),(1096,1759,'07:00','18:00','Karongi - Volcanoes National Park','This Morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Musanze. The distance from Karongi to Musanze is about 187Km, which takes about 4hrs drive with no rush. Dinner and Overnight at Davinci Gorilla Lodge.','2019-11-07 12:36:14','2019-11-07 12:36:14'),(1097,1760,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. You will descend back to the starting point where our guide will be waiting to take you back to your lodge for lunch and rest. Dinner and Overnight at Davinci Gorilla Lodge.','2019-11-07 12:37:26','2019-11-07 12:37:26'),(1098,1761,'07:00','18:00','Volcanoes N.P - Bwindi(Uganda)','After breakfast, take a visit to ibyiwacu cultural village to learn about the Rwandan culture and traditions, Later, proceed to the Rwanda Uganda border crossing at Cyanika. Stop over at Kabalee Town for Lunch and a short rest. Later, you will head out for the Batwa experience. Dinner and Overnight at Icumbi Gorilla Safari Lodge in Bwindi','2019-11-07 12:38:53','2019-11-07 12:38:53'),(1099,1762,'07:00','18:00','Bwindi(Uganda) - Kigali Rwanda','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. Later, drive back to Rwanda-Kigali. Dinner and Overnight at Onomo Hotel.','2019-11-07 12:40:13','2019-11-07 12:40:13'),(1100,1763,'07:00','18:00','Kigali','Mount Kigali Hiking.\r\nAfter breakfast, a visit to the top of Mt. Kigali for views of the city and the countryside. To the top of the mountain, you can perform different activities including horse ride, trail ride, zip lines. On the way back from the Hiking, you will visit Nyamirambo Womens Center and do some shopping for your souvenir. Dinner and Overnight at Onomo Hotel.','2019-11-07 12:41:00','2019-11-07 12:41:00'),(1101,1764,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, Later, after lunch drive to Kigali international Airport for your departure flight.','2019-11-07 12:47:10','2019-11-07 12:47:10'),(1112,1775,'06:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at the Airport. Depending on your arrival time, if you arrive night time, we check into The Retreat by Heaven for a relaxation moment after the long flight.','2019-11-07 14:33:57','2019-11-07 14:33:57'),(1113,1776,'07:00','18:00','Kigali  Nyungwe National Park.','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the Kings Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway (Dinner and overnight at One &Only Nyungwe House).','2019-11-07 14:54:04','2019-11-07 14:54:04'),(1114,1777,'05:00','18:00','Nyungwe National Park - Karongi','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\n(Dinner and Overnight at Kivu Lodge).','2019-11-07 14:55:24','2019-11-07 14:55:24'),(1115,1778,'07:00','18:00','Karongi - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch and some relaxation. Later drive to volcanoes national park. (Dinner and Overnight at Bisate Lodge).','2019-11-07 14:56:56','2019-11-07 14:56:56'),(1116,1779,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze)for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and some relaxation. Later drive to Gorilla Guardians Village to learn about the Rwandan culture and traditions. (Dinner and Overnight at Bisate Lodge).','2019-11-07 15:00:52','2019-11-07 15:00:52'),(1117,1780,'07:00','18:00','Musanze - Uganda','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to Musanze for lunch before being transferred to Lake Bunyonyi Uganda. (Dinner and Overnight at Bird Nest Bunyonyi Resort).','2019-11-07 15:04:00','2019-11-07 15:04:00'),(1118,1781,'07:00','18:00','Bunyonyi  Bwindi National Park.','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to Bwindi impenetrable national park. (Dinner and Overnight at Trackers Safari Lodge).','2019-11-07 15:05:54','2019-11-07 15:05:54'),(1119,1782,'07:00','18:00','Gorilla Trekking Batwa Experience.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Trackers Safari Lodge).','2019-11-07 15:07:56','2019-11-07 15:07:56'),(1120,1783,'07:00','18:00','Queen Elizabeth National Park.','After an early breakfast, proceed to Queen Elizabeth National Park.  Lunch En route, you will have the chance to drive through the Ishasha sector of Queen Elizabeth where you will watch tree climbing lions. On arrival to the Park, we shall have a short game drive and later drive to your lodge for Dinner and Overnight at Mweya Safari Lodge).','2019-11-07 15:10:57','2019-11-07 15:10:57'),(1121,1784,'07:00','18:00','Queen Elizabeth - Kazinga Channel.','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. (Dinner and overnight stay at Mweya Safari lodge)','2019-11-07 15:13:32','2019-11-07 15:13:32'),(1122,1785,'07:00','18:00','Queen Elizabeth - Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at The Retreat by Heaven for Dinner and Overnight.','2019-11-07 15:15:03','2019-11-07 15:15:03'),(1123,1786,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-07 15:16:31','2019-11-07 15:16:31'),(1124,1787,'06:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at the Airport. Depending on your arrival time, if you arrive night time, we check into Hotel des Mille Collines for a relaxation moment after the long flight.','2019-11-08 08:53:23','2019-11-08 08:53:23'),(1125,1788