er Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Gorilla Safari Lodge).','2019-11-08 09:03:04','2019-11-08 09:03:04'),(1132,1795,'07:00','18:00','Queen Elizabeth National Park.','After an early breakfast, proceed to Queen Elizabeth National Park.  Lunch En route, you will have the chance to drive through the Ishasha sector of Queen Elizabeth where you will watch tree climbing lions. On arrival to the Park, we shall have a short game drive and later drive to your lodge for Dinner and Overnight at Mweya Safari Lodge).','2019-11-08 09:04:42','2019-11-08 09:04:42'),(1133,1796,'07:00','18:00','Queen Elizabeth - Kazinga Channel.','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. (Dinner and overnight stay at Mweya Safari lodge)','2019-11-08 09:05:55','2019-11-08 09:05:55'),(1134,1797,'06:00','18:00','Queen Elizabeth N.P - Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at Hotel des Mille Collines for Dinner and Overnight.','2019-11-08 09:12:16','2019-11-08 09:12:16'),(1135,1798,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-08 09:13:25','2019-11-08 09:13:25'),(1136,1799,'06:00','18:00','Goma','Welcome! this day at your arrival, you will be picked by our company representative in Congo, and then transfer you to your hotel in Goma for a welcome meal, briefing about tour. If time allows, take a city tour in Goma. Dinner and Overnight at Cap Kivu Hotel.','2019-11-08 10:12:24','2019-11-08 10:12:24'),(1137,1800,'06:00','18:00','Nyiragongo Hiking','After breakfast, drive to Kibati Ranger Post, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, you will receive a briefing. Park rangers lead all treks and porters are available for hire at Kibati ranger station. The ascent up the volcano starts around 10:00am with most climbing groups reaching the summit by 5:00pm. The time required to reach the summit depends on the average fitness of each group, but typically takes 4  6 hours.  It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the worlds largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\n*Trekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0C/32  rated sleeping bag), good walking shoes, sun cream, etc.','2019-11-08 10:14:32','2019-11-08 10:14:32'),(1138,1801,'06:00','18:00','Nyiragongo Volcano descent - Gisenyi.','Early morning, take a visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. The driver will pick you up at the meeting place and drive to Rwanda. At the border of Corniche, about 30 minutes later, the driver arrives at Rwanda, where the driver of Rwanda will pick you up. After completing the immigration formalities, head to your hotel in Gisenyi for lunch &rest. Dinner and Overnight at Lake Kivu Serena Hotel.','2019-11-08 10:15:25','2019-11-08 10:15:25'),(1139,1802,'06:00','18:00','Kivu Boat Ride  Nyungwe N.P.','After breakfast, you will do a boat ride on lake kivu, visit fishing activities, hot spring and a visit to coffee plants. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Gisenyi to Nyungwe National Park its about 192Km and road takes about 3h51min with no rush. Arriving at Nyungwe Forest National Park, where you will Connect to your Hotel for relaxation. Dinner and Overnight at Nyugwe Top View Hill Hotel.','2019-11-08 10:17:34','2019-11-08 10:17:34'),(1140,1803,'05:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-08 10:18:43','2019-11-08 10:18:43'),(1141,1804,'06:00','18:00','Drive to Burundi-Bujumbura','After breakfast, check out from the Hotel, and drive to Bujumbura city; lunch En-route, proceed to your hotel. If time allows, take a city tour in Bujumbura. Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 10:19:59','2019-11-08 10:19:59'),(1142,1805,'06:00','18:00','Visit Source of Nile- Karera Waterfalls.','After early morning breakfast, drive to Bururi, precisely at Rutovu in the southern sector of Burundi with a stopover at the source of the Nile. Later, take a visit to Karera waterfalls in Rutana in the same road (RN8) and arrive in Gitega in afternoon time, visit Gitega national museum to learn more about Burundi culture and Drum exhibition at Gishora. From here you will drive back to your hotel in Bujumbura for Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 10:20:58','2019-11-08 10:20:58'),(1143,1806,'06:00','18:00','Burundi - Rwanda','Have a relaxed full board breakfast at the hotel and later be ready to drive back to Rwanda. on your way visit the Ethnographic Museum in huye and the Royal palace museum in Nyanza. After lunch drive to Kigali. Dinner and Overnight at Kigali Serena Hotel.','2019-11-08 10:21:56','2019-11-08 10:21:56'),(1144,1807,'06:00','18:00','Kigali City Tour& Drive to Musanze.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to volcanoes National park, where you will Connect to your Lodge for relaxationDinner and Overnight at Ingagi Park View Lodge','2019-11-08 10:23:34','2019-11-08 10:23:34'),(1145,1808,'06:00','18:00','Rwanda - Uganda','After breakfast, take a visit to Gorilla Guardians (ibyiwacu cultural village) to learn about the Rwandan culture and traditions, Later, after lunch, you will drive to Uganda, check-in at Bird Nest Bunyonyi Resort for Dinner and Overnight.','2019-11-08 10:25:29','2019-11-08 10:25:29'),(1146,1809,'06:00','18:00','Lake Bunyonyi  Bwindi N.P','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to bwindi impenetrable national park. Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 10:27:13','2019-11-08 10:27:13'),(1147,1810,'07:00','18:00','Uganda Gorilla  Batwa Experience.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 10:29:32','2019-11-08 10:29:32'),(1148,1811,'06:00','18:00','Queen Elizabeth National Park.','After an early breakfast, drive to Queen Elizabeth National Park. You will enjoy an en route game drive en route and see animals like Elephants, Buffaloes, mongoose among so many others. After your lunch, you will for a boat ride on Kazinga channel where you will have the opportunity to see a number of water animals like the hippos, crocodiles and later go to your lodge where you will have dinner from Mweya Safari Lodge.','2019-11-08 10:34:11','2019-11-08 10:34:11'),(1149,1812,'07:00','18:00','Queen Elizabeth N.P- Kampala Town.','Rise early, for a game drive in the savanna of queen Elizabeth national park with great views of wildlife in the park. Later, return to your lodge for lunch and short rest. After lunch, you will drive to Kampala. where you will Connect to your Hotel for relaxation. Dinner and Overnight at Kampala Sheraton Hotel','2019-11-08 10:36:15','2019-11-08 10:36:15'),(1150,1813,'06:00','18:00','Kampala City Tour - Jinja.','After breakfast, you may visit places like historical and Cultural sites which include the Kasubi Tombs, Namugongo shrine and Ssezibwa fall.\r\nLater after lunch, you will drive to Jinja where you will connect to your hotel for Dinner and Overnight at Jinja Nile Resort.','2019-11-08 10:38:25','2019-11-08 10:38:25'),(1151,1814,'06:00','18:00','Kenya Lake Nakuru National Park.','After an early breakfast, proceed, to Kenya Lake Nakuru National Park situated in the Rift Valley Region. From the North to the South of Kenya the valley is lined with a series of freshwater and soda based volcanic lakes. Arrive, check-in at your lodge and spend the evening at leisure. Dinner and overnight stay at Lake Nakuru Sopa Lodge.','2019-11-08 10:40:14','2019-11-08 10:40:14'),(1152,1815,'07:00','18:00','Game Drive Lake Nakuru National Park.','You start with an early morning game drive before getting back to your lodge for breakfast. After breakfast you get more game drives. In this Park you will have time to view huge animals like Rhinos, Elephants, Lions, Hippos and flocks of flamingo birds around the lake. Return to your lodge at mid-day for lunch, relax before an evening game drive in the park. Dinner and Overnight at Lake Nakuru Sopa Lodge.','2019-11-08 10:41:57','2019-11-08 10:41:57'),(1153,1816,'06:00','18:00','Lake Nakuru N.P- Masai Mara N.P.','After breakfast, depart for the world famous Masai Mara National Reserve. Arrive at your camp for check-in and have Lunch. The camp blends in perfectly with its surrounding hillside landscape. The accent here is on the Masai people and the wealth of wildlife, Bird life, and natural flora to be found in the fabled Masai Mara Game Reserve. Enjoy an afternoon game drive around the world famous Masai Mara. Dinner and overnight stay at the Masai Mara Sopa Lodge.','2019-11-08 10:44:20','2019-11-08 10:44:20'),(1154,1817,'06:00','18:00','Game Drive Masai Mara N.P.','The whole day will be spent here exploring the hidden treasures of Masai Mara National Park. Along the game drives, expect to easily see rare animals such as Lions, Leopard, Jackals, plus many others such as Rhinos, Hippos, Crocodiles, Giraffe, Wildebeests, Zebras, Buffalo, Warthogs, Hyenas, Wild dogs, several antelope species and Elephant among others. Also expect excellent birding with over 450 Bird species identified.\r\nAfter lunch, take a cultural tour among the Masai Communities and explore more about the Masai Culture. All meals and overnight stay at Masai Mara Sopa Lodge.','2019-11-08 10:45:41','2019-11-08 10:45:41'),(1155,1818,'06:00','18:00','Masai Mara National Park - Nairobi','Have breakfast at the camp and depart for Nairobi, Kenyas most colorful city from here you will proceed to Jomo Kenyatta International Airport for your departure flight.','2019-11-08 10:46:36','2019-11-08 10:46:36'),(1156,1819,'06:00','18:00','Goma','Welcome! this day at your arrival, you will be picked by our company representative in Congo, and then transfer you to your hotel in Goma for a welcome meal, briefing about tour. If time allows, take a city tour in Goma. Dinner and Overnight at Cap Kivu Hotel.','2019-11-08 12:40:49','2019-11-08 12:40:49'),(1157,1820,'06:00','18:00','Nyiragongo Volcano Hiking.','After breakfast, drive to Kibati Ranger Post, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, you will receive a briefing. Park rangers lead all treks and porters are available for hire at Kibati ranger station. The ascent up the volcano starts around 10:00am with most climbing groups reaching the summit by 5:00pm. The time required to reach the summit depends on the average fitness of each group, but typically takes 4  6 hours.  It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the worlds largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\n*Trekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0C/32  rated sleeping bag), good walking shoes, sun cream, etc.','2019-11-08 12:41:43','2019-11-08 12:41:43'),(1158,1821,'06:00','18:00','Nyiragongo Volcano descent - Gisenyi.','Early morning, take a visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. The driver will pick you up at the meeting place and drive to Rwanda. At the border of Corniche, about 30 minutes later, the driver arrives at Rwanda, where the driver of Rwanda will pick you up. After completing the immigration formalities, head to your hotel in Gisenyi for lunch &rest. Dinner and Overnight at Lake Kivu Serena Hotel.','2019-11-08 12:42:39','2019-11-08 12:42:39'),(1159,1822,'06:00','18:00','Kivu Boat Ride  Nyungwe N.P.','After breakfast, you will do a boat ride on lake kivu, visit fishing activities, hot spring and a visit to coffee plants. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Gisenyi to Nyungwe National Park its about 192Km and road takes about 3h51min with no rush. Arriving at Nyungwe Forest National Park, where you will Connect to your Hotel for relaxation. Dinner and Overnight at Nyugwe Top View Hill Hotel.','2019-11-08 12:44:02','2019-11-08 12:44:02'),(1160,1823,'17:00','06:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the 