8:00','Kenya Lake Nakuru National Park.','After an early breakfast, proceed, to Kenya Lake Nakuru National Park situated in the Rift Valley Region. From the North to the South of Kenya the valley is lined with a series of freshwater and soda based volcanic lakes. Arrive, check-in at your lodge and spend the evening at leisure. Dinner and overnight stay at Lake Nakuru Sopa Lodge.','2019-11-08 14:23:30','2019-11-08 14:23:30'),(1192,1855,'07:00','18:00','Lake Nakuru National Park.','You start with an early morning game drive before getting back to your lodge for breakfast. After breakfast you get more game drives. In this Park you will have time to view huge animals like Rhinos, Elephants, Lions, Hippos and flocks of flamingo birds around the lake. Return to your lodge at mid-day for lunch, relax before an evening game drive in the park. Dinner and Overnight at Lake Nakuru Sopa Lodge.','2019-11-08 14:24:58','2019-11-08 14:24:58'),(1193,1856,'06:00','18:00','Lake Nakuru N.P- Masai Mara N.P.','After breakfast, depart for the world famous Masai Mara National Reserve. Arrive at your camp for check-in and have Lunch. The camp blends in perfectly with its surrounding hillside landscape. The accent here is on the Masai people and the wealth of wildlife, Bird life, and natural flora to be found in the fabled Masai Mara Game Reserve. Enjoy an afternoon game drive around the world famous Masai Mara. Dinner and overnight stay at the Masai Mara Sopa Lodge.','2019-11-08 14:26:51','2019-11-08 14:26:51'),(1194,1857,'19:00','18:00','Masai Mara National Park','The whole day will be spent here exploring the hidden treasures of Masai Mara National Park. Along the game drives, expect to easily see rare animals such as Lions, Leopard, Jackals, plus many others such as Rhinos, Hippos, Crocodiles, Giraffe, Wildebeests, Zebras, Buffalo, Warthogs, Hyenas, Wild dogs, several antelope species and Elephant among others. Also expect excellent birding with over 450 Bird species identified.\r\nAfter lunch, take a cultural tour among the Masai Communities and explore more about the Masai Culture. All meals and overnight stay at Masai Mara Sopa Lodge.','2019-11-08 14:27:57','2019-11-08 14:27:57'),(1195,1858,'07:00','18:00','Masai Mara N.P - Nairobi','Have breakfast at the camp and depart for Nairobi, Kenyas most colorful city from here you will proceed to Jomo Kenyatta International Airport for your departure flight.','2019-11-08 14:29:42','2019-11-08 14:29:42'),(1196,1859,'06:00','18:00','Goma','Welcome! this day at your arrival, you will be picked by our company representative in Congo, and then transfer you to your hotel in Goma for a welcome meal, briefing about tour. If time allows, take a city tour in Goma. Dinner and Overnight at Cap Kivu Hotel.','2019-11-08 14:50:43','2019-11-08 14:50:43'),(1197,1860,'06:00','18:00','Nyiragongo Volcano Hiking.','After breakfast, drive to Kibati Ranger Post, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, you will receive a briefing. Park rangers lead all treks and porters are available for hire at Kibati ranger station. The ascent up the volcano starts around 10:00am with most climbing groups reaching the summit by 5:00pm. The time required to reach the summit depends on the average fitness of each group, but typically takes 4  6 hours.  It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the worlds largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\n*Trekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0C/32  rated sleeping bag), good walking shoes, sun cream, etc.','2019-11-08 14:52:09','2019-11-08 14:52:09'),(1198,1861,'06:00','18:00','Nyiragongo Volcano  - Gisenyi.','Early morning, take a visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. The driver will pick you up at the meeting place and drive to Rwanda. At the border of Corniche, about 30 minutes later, the driver arrives at Rwanda, where the driver of Rwanda will pick you up. After completing the immigration formalities, head to your hotel in Gisenyi for lunch &rest. Dinner and Overnight at Lake Kivu Serena Hotel.','2019-11-08 14:52:59','2019-11-08 14:52:59'),(1199,1862,'07:00','18:00','Kivu Boat Ride  Nyungwe N.P.','After breakfast, you will do a boat ride on lake kivu, visit fishing activities, hot spring and a visit to coffee plants. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Gisenyi to Nyungwe National Park its about 192Km and road takes about 3h51min with no rush. Arriving at Nyungwe Forest National Park, where you will Connect to your Hotel for relaxation. Dinner and Overnight at Nyugwe Top View Hill Hotel.','2019-11-08 14:54:42','2019-11-08 14:54:42'),(1200,1863,'06:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-08 14:55:54','2019-11-08 14:55:54'),(1201,1864,'06:00','18:00','Drive to Burundi-Bujumbura','After breakfast, check out from the Hotel, and drive to Bujumbura city; lunch En-route, proceed to your hotel. If time allows, take a city tour in Bujumbura. Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 14:56:51','2019-11-08 14:56:51'),(1202,1865,'06:00','18:00','Visit Source of Nile- Karera Waterfalls.','After early morning breakfast, drive to Bururi, precisely at Rutovu in the southern sector of Burundi with a stopover at the source of the Nile. Later, take a visit to Karera waterfalls in Rutana in the same road (RN8) and arrive in Gitega in afternoon time, visit Gitega national museum to learn more about Burundi culture and Drum exhibition at Gishora. From here you will drive back to your hotel in Bujumbura for Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 14:58:09','2019-11-08 14:58:09'),(1203,1866,'06:00','18:00','Transfer Back to Kigali.','Have a relaxed full board breakfast at the hotel and later be ready to drive back to Rwanda. on your way visit the Ethnographic Museum in huye and the Royal palace museum in Nyanza. After lunch drive to Kigali. Dinner and Overnight at Kigali Serena Hotel.','2019-11-08 14:59:03','2019-11-08 14:59:03'),(1204,1867,'06:00','18:00','Kigali City Tour - Musanze.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to volcanoes National park, where you will Connect to your Lodge for relaxationDinner and Overnight at Ingagi Park View Lodge','2019-11-08 15:00:07','2019-11-08 15:00:07'),(1205,1868,'06:00','18:00','Gorilla Guardians  Lake Bunyonyi.','After breakfast, take a visit to Gorilla Guardians (ibyiwacu cultural village) to learn about the Rwandan culture and traditions, Later, after lunch, you will drive to Uganda, check-in at Bird Nest Bunyonyi Resort for Dinner and Overn