noon game drive around the world famous Masai Mara. Dinner and overnight stay at the Masai Mara Sopa Lodge.','2019-11-08 15:23:27','2019-11-08 15:23:27'),(1214,1877,'07:00','18:00','Masai Mara National Park','The whole day will be spent here exploring the hidden treasures of Masai Mara National Park. Along the game drives, expect to easily see rare animals such as Lions, Leopard, Jackals, plus many others such as Rhinos, Hippos, Crocodiles, Giraffe, Wildebeests, Zebras, Buffalo, Warthogs, Hyenas, Wild dogs, several antelope species and Elephant among others. Also expect excellent birding with over 450 Bird species identified.\r\nAfter lunch, take a cultural tour among the Masai Communities and explore more about the Masai Culture. All meals and overnight stay at Masai Mara Sopa Lodge.','2019-11-08 15:24:33','2019-11-08 15:24:33'),(1215,1878,'07:00','18:00','Masai Mara National Park - Nairobi','Have breakfast at the camp and depart for Nairobi, Kenyas most colorful city from here you will proceed to Jomo Kenyatta International Airport for your departure flight.','2019-11-08 15:25:19','2019-11-08 15:25:19'),(1219,1889,'15:00','18:00','Kigali','Welcome! This day at your arrival, you will be picked by our driver guide (Company representative) and then transfer you to your hotel in Kigali for a relaxation moment after the long flight and briefing about this great adventure tour.\r\nDinner and Overnight at The Retreat by Heaven','2019-11-12 09:53:10','2019-11-12 09:53:10'),(1220,1890,'07:00','18:00','Kigali -Nyungwe national park','After Morning breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, from here you will drive to Nyungwe forest having our lunch en-route in Huye, and proceed to Nyungwe National park head Office for our 3pm Canopy walkway.\r\nDinner and overnight at One &Only Nyungwe House','2019-11-12 09:53:50','2019-11-12 09:53:50'),(1221,1891,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 2hrs drive from Nyungwe  National Park to Karongi where you will connect to your Hotel for relaxation.\r\nDinner and Overnight at Kivu Lodge.','2019-11-12 09:54:39','2019-11-12 09:54:39'),(1222,1892,'08:00','18:00','Kibuye - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake Kivu\r\narriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Volcanoes National Park. Where you will connect to your hotel for relaxation.\r\nDinner and Overnight at Bisate Lodge.','2019-11-12 09:56:07','2019-11-12 09:56:07'),(1223,1893,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. \r\nDinner and Overnight at Bisate Lodge.','2019-11-12 09:57:27','2019-11-12 09:57:27'),(1224,1894,'07:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your Packed Lunch, trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, you will drive back to Kigali international airport for your departure flight.','2019-11-12 09:58:56','2019-11-12 09:58:56'),(1225,1895,'15:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive)Check-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.\r\nDinner and Overnight at Magashi Tented Camp','2019-11-12 10:25:47','2019-11-12 10:25:47'),(1226,1896,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.\r\nDinner and Overnight at the Retreat by Heaven.','2019-11-12 10:29:16','2019-11-12 10:29:16'),(1227,1897,'08:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Huye. We have the opportunity of exploring the Ethnographic Museum in Huye. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway\r\nDinner and overnight at One &Only Nyungwe House','2019-11-12 10:30:11','2019-11-12 10:30:11'),(1228,1898,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\nDinner and Overnight at Kivu Lodge.','2019-11-12 10:31:00','2019-11-12 10:31:00'),(1229,1899,'08:00','18:00','Kibuye - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake Kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Volcanoes National Park. Where you will connect to your hotel for relaxation.\r\nDinner and Overnight at Bisate Lodge.','2019-11-12 10:33:50','2019-11-12 10:33:50'),(1230,1900,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. \r\nDinner and Overnight at Bisate Lodge.','2019-11-12 10:34:58','2019-11-12 10:34:58'),(1231,1901,'07:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast, you will drive to Kigali, take a visit to Gisozi Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-12 10:36:02','2019-11-12 10:36:02'),(1232,1902,'03:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive)Check-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.\r\nDinner and Overnight at Magashi Tented Camp','2019-11-12 11:18:20','2019-11-12 11:18:20'),(1233,1903,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.\r\nDinner and Overnight at the Retreat by Heaven.','2019-11-12 11:19:22','2019-11-12 11:19:22'),(1234,1904,'08:00','18:00','Kigali -Nyungwe national park','This morning we depart 