e traditional Masai settlements and lakes, inhabited by thousands of flamingos, dot the valley floor. Arrive by afternoon in the famed Mara and venture into the Masai Mara Game Reserve for our first game drive and wildlife encounters\r\nDinner and Overnight at Masara Serena Lodge.','2019-11-12 14:10:52','2019-11-12 14:10:52'),(1248,1918,'08:00','18:00','Masai Mara National Park','Early breakfast followed by game viewing drive in the Masai Mara plains in search for the Big Five  leopard, lion, elephant, rhino and buffalo  as well as numerous grazing animals such as wildebeest, zebra and giraffe. Also includes good stocks of hippo and crocodile in the Mara River and an enormous variety of birds. The Mara encompasses many peoples ideal of Africa: rolling green hills, vast open horizons and plains stocked with wildlife.\r\nDinner and Overnight at Mara Serena Safari Lodge.','2019-11-12 14:12:00','2019-11-12 14:12:00'),(1249,1919,'07:00','18:00','Masai Mara National Park -Nairobi','we leave the Mara and drive back through Narok, stopping to admire the colorful local markets, before continuing to Nairobi where our safari ends.','2019-11-12 14:13:00','2019-11-12 14:13:00'),(1258,1929,'15:00','18:00','Entebbe International Airport','Upon arrival at Entebbe Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel for a welcome meal, briefing about this great adventure tour.\r\nDinner and Overnight at Jinja Nile Resort.','2019-11-13 08:58:35','2019-11-13 08:58:35'),(1259,1930,'08:00','18:00','Jinja -Kampala','After breakfast, take a boat ride to the source of the Nile a-quite beautiful place, filled with palm trees and fantastic tropical plants. You will take a Boat ride to the actual source of the river Nile and beyond the lake where you will take pictures for future memories. After lunch you will drive to Kampala where you will visit Gaddafi Mosque, Uganda Museum and Kassubi Museum.\r\nDinner and Overnight at Golf Course Hotel.','2019-11-13 08:59:09','2019-11-13 08:59:09'),(1260,1931,'08:00','18:00','Jinja -Lake Nakuru Kenya','After breakfast, you will drive you to Kibale National Park, this park is located in the southern part of Uganda and its a rain forest park covering a size of 766km2 with an altitude of 1,100 to 1600m above sea level. \r\n\r\nAlong the way, you will stop at the equator to enjoy some photos and also have your lunch at Mbarara town, after proceed to the park arriving in the afternoon, check in at your lodge and after the park ranger will accompany you to the park in order to enjoy a guided nature walk. You will have a chance to view many animal species like the elephants, monkeys, birds and many more. Later after the nature walk, return to the lodge for relaxation. \r\nDinner and Overnight at Turaco Treetops.','2019-11-13 09:00:18','2019-11-13 09:00:18'),(1261,1932,'08:00','18:00','Kibale -Queen Elizabeth National Park','After breakfast, you will be transferred to the park headquarters for the briefing from the senior park ranger and at 8.00 am your guide will transfer you to the starting point for chimpanzee tracking. Normally the whole activity takes less than 4 hours. Later the guide will lead you to Lodge for lunch. In the afternoon transfer to Queen Elizabeth national park. It takes 2 hours to get to Queen Elizabeth national park.\r\nDinner and Overnight at Kingfisher Lodge.','2019-11-13 09:01:37','2019-11-13 09:01:37'),(1262,1933,'07:00','18:00','Queen Elizabeth National Park','Wake up early for breakfast at 6.30am and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the Kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators.\r\n\r\nDinner and Overnight at King Fisher Lodge.','2019-11-13 09:02:50','2019-11-13 09:02:50'),(1263,1934,'08:00','18:00','Queen Elizabeth National Park  - Musanze','Have breakfast at leisure and embark on your journey to Rwanda crossing through Cyanika or Katuna boarder and arriving Musanze in the afternoon.\r\n\r\nDinner and Overnight at Ingagi Park View Lodge.','2019-11-13 09:04:52','2019-11-13 09:04:52'),(1264,1935,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. \r\nDinner and Overnight at Ingagi Park View Lodge.','2019-11-13 09:09:15','2019-11-13 09:09:15'),(1265,1936,'07:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in Kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Kigali. \r\nDinner and Overnight at Hotel de Mille Collines.','2019-11-13 09:12:23','2019-11-13 09:12:23'),(1266,1937,'09:00','18:00','Kigali International airport','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-13 09:14:01','2019-11-13 09:14:01'),(1267,1938,'16:00','18:00','Kigali -Volcanoes National Park','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative). Depending on your arrival time, if you arrive evening time, will drive you to Volcanoes National Park check into  Classic Hotel for a relaxation moment after the long flight.','2019-11-13 10:00:07','2019-11-13 10:00:07'),(1268,1939,'07:00','18:00','Volcanoes National Park','After breakfast, you will be transferred to the park headquarters in kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending your time with mountain gorillas, return to the base and meet your driver and a transfer for lunch.  After lunch you will go for Ibyiwacu cultural village to learn about  Rwandan culture and Traditions. \r\nDinner and Overnight at  Classic Hotel.','2019-11-13 10:06:06','2019-11-13 10:06:06'),(1269,1940,'09:00','18:00','Volcanoes National Park - Kibuye','Depart Volcanoes National Park to Karongi. The drive is about 4 hrs with breathtaking hilly view of the land of the thousand hills. Dinner and Overnight at Rwiza Village Hotel.','2019-11-13 10:12:04','2019-11-13 10:12:04'),(1270,1941,'08:00','18:00','Kibuye - Volcanoes National Park','Morning after breakfast, you will do a boat ride and Hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Karongi to Nyungwe National Park its about 153 Km and road takes about 3hrs 24min with no rush. Dinner and Overnight at  Nyungwe Nziza Ecolodge.','2019-11-13 10:27:11','2019-11-13 10:27:11'),(1271,1942,'07:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch. After Lunch, you will go for colobus Monkeys trek. Dinner and Overnight at  Nyungwe Nziza Eco lodge.','2019-11-13 10:30:09','2019-11-13 10:30:09'),(1272,1943,'07:00','18:00','Nyungwe National Park -Kigali','After breakfast, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds!  Later back to your Hotel for lunch After lunch, your guide will transfer you to Kigali International Airport for your flight back home.','2019-11-13 10:59:55','2019-11-13 10:59:55'),(1273,1944,'15:00','17:00','Kigali','Welcome! this day at your arrival, you will be picked by our company representative, and then transfer you to your hotel in Kigali for a welcome meal, briefing about tour. If time allows, take a city tour in Kigali.\r\nDinner and Overnight at Victoria Blue Hotels Apartments.','2019-11-14 14:11:27','2019-11-14 14:11:27'),(1274,1945,'08:00','18:00','Kigali - Kirehe - Akagera National Park','Transfer to Kirehe; visit Imigongo and practice ancient artisanry in the region, watch the waterfalls in Rusumo (Border between Tanzania and Rwanda). You will have will and later drive Akagera National Park.\r\nDinner and Overnight at Akagera Game Lodge.','2019-11-14 14:13:11','2019-11-14 14:13:11'),(1275,1946,'07:00','18:00','Akagera National Park','Morning after breakfast, set off for a wonderful morning game drive through the Savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch. After lunch you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. \r\nDinner and Overnight at Akagera Game Lodge.','2019-11-14 14:19:03','2019-11-14 14:19:03'),(1276,1947,'08:00','18:00','Akagera National Park -Kigali','This day After breakfast, we shall have yet another day of adventure within the park, enjoying the beautiful sceneries of Rwandas hilly landscape, comprised of a blend of wetland, savannah and woodland, the natural forests also make quite a view. With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm. \r\nDinner and Overnight at Victoria Blue Hotels &Apartments.','2019-11-14 14:21:13','2019-11-14 14:21:13'),(1277,1948,'08:00','18:00','Kigali -Nyungwe national park','This morning you will depart from Kigali to Huye. En-route visit the Basilica of Kabgayi, kings palace and traditional cows in Nyanza. After lunch you will drive to huye to visit National University of Rwanda. \r\nDinner and Overnight at Mater Bon Consili.','2019-11-14 14:22:58','2019-11-14 14:22:58'),(1278,1949,'08:00','18:00','Huye -Nyungwe National Park','Morning after breakfast, visit the ethnographic Museum, introduction to Rwandas kingdoms, discovery of colonial architecture, enjoy traditional dancers from the museum. From here you will go for lunch, after lunch drive to kanyaru border post between Rwanda and Burundi boarder to visit the Kanyuru tea plantation. Later drive to Nyungwe National Park.\r\nDinner and Overnight at Nyungwe Top View lodge.','2019-11-14 14:24:48','2019-11-14 14:24:48'),(1279,1950,'07:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees and long-tailed monkeys. After lunch, you will visit Gisakura Tea Factory. \r\nDinner and Overnight at Nyungwe Top View lodge.','2019-11-14 14:25:52','2019-11-14 14:25:52'),(1280,1951,'07:00','18:00','Nyungwe National Park','Breakfast, with your packed lunch move for a full day forest guided walk within Nyungwe Forest National Park. On this long walk, you will visit the Kamiranzovu waterfalls where you will enjoy your picnic lunch. On this walk expect to see a lot of bird species and also primates like monkeys among others. Later drive back to your hotel.\r\nDinner and Overnight at Nyungwe Top View Lodge.','2019-11-14 14:38:59','2019-11-14 14:38:59'),(1281,1952,'07:00','18:00','Nyungwe National Park','You will have breakfast and set off with your guide to search for the Colobus monkeys in Nyungwe Forest. The forest is said to be home to the biggest troops of Angola Colobuses in the world; numbering over 400 troops. The hike to where these primates stay is a thrilling experience as the guides explain the behavior, activities and intelligence gimmicks of the primates. A walk in the forest is a whole learning experience about the botany, ornithology and ecology of the forest.\r\nDinner and Overnight at Nyungwe Top View lodge.','2019-11-14 14:40:04','2019-11-14 14:40:04'),(1282,1953,'08:00','18:00','Nyungwe National Park -Kibuye','After breakfast, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds!  After canopy experience you will drive back to your hotel for lunch before being transferred to karongi where you will connect to your hotel for relaxation. \r\nDinner and Overnight at Moriah Hill Hotel.','2019-11-14 14:40:53','2019-11-14 14:40:53'),(1283,1954,'08:00','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town) \r\nDinner and Overnight at Kivu Hill View Hotel.','2019-11-14 14:41:49','2019-11-14 14:41:49'),(1284,1955,'08:00','18:00','Gisenyi -Volcanoes National Park','After breakfast, you will do a boat ride, visit fishing activities, hot spring water and Visit coffee plants; pick beans, entering the industry with full educational explanations of the plantation. After enjoying kivu lake, you will go for lunch, later drive to Volcanoes National Park.\r\nDinner and Overnight at Davinci Gorilla Lodge.','2019-11-14 14:42:35','2019-11-14 14:42:35'),(1285,1956,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. \r\nDinner and Overnight at Davinci Gorilla Lodge.','2019-11-14 14:43:18','2019-11-14 14:43:18'),(1286,1957,'07:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Nkotsi Village for Community activities.\r\nDinner and Overnight at Davici Gorilla Lodge.','2019-11-14 14:44:04','2019-11-14 14:44:04'),(1287,1958,'08:00','18:00','Volcanoes National Park','Depart from the lodge at 8:00 am and start Musanze city tour accompanied with your guide. Your tour starts from the government institutions headquarters, local market, Dian Fossey exhibition center, different hotels, night clubs, bars and restaurants, residential areas, etc. After this tour you drive 5 minutes to Mukungwa River, 2km out of the town for kayaking experience. This lasts between 1 up 2 hours. After this fabulous experience you drive straight to Cyanika border approximately 35 km from Musanze town. You have your lunch at the border and come back to Musanze in the evening for overnight and relaxation.\r\nDinner and Overnight at Davinci Gorilla Lodge.','2019-11-14 14:45:04','2019-11-14 14:45:04'),(1288,1959,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel at 6:30 to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. On your way back you have your lunch, drinks and other necessities at the foot of the mountain.\r\nDinner and Overnight at Davinci Gorilla Lodge.','2019-11-14 14:45:51','2019-11-14 14:45:51'),(1289,1960,'08:00','18:00','Volcanoes National Park - Kigali','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to musanze for lunch before being transferred to Kigali.\r\nDinner and Overnight at Victoria Blue Hotels & Apartments.','2019-11-14 14:46:28','2019-11-14 14:46:28'),(1290,1961,'08:00','18:00','KIGALI','After breakfast, a visit to the top of Mt. Kigali for views of the city and the countryside. To the top of the mountain, you can perform different activities including horse ride, trail ride, zip lines. On the way back from the Hiking, you will visit Nyamirambo Womens Center and do some shopping for your souvenir.\r\nDinner and Overnight at Victoria Blue Hotels &Apartments.','2019-11-14 14:47:08','2019-11-14 14:47:08'),(1291,1962,'08:00','18:00','Kigali - Nyamata','After breakfast, drive to Nyamata Genocide Memorial where mass killings occurred during the 1994 genocide; more than 2,500 people were killed in the church. The Nyamata Genocide Memorial is located about 35kilometers south of the capital city of Kigali. Located in the Bugasera region, In the church at Nyamata, there will be graphic and audio-visual displays that will focus particularly on the mass rape, brutalization of women and the use of HIV as a deliberate weapon of genocide. Return to the city for lunch, later you will visit Kigali Genocide Memorial Centre, Belgian peacekeepers memorial, Hotel Rwanda (Hotel des Mille Collins) Inema Arts Centre and Kimironko Market. \r\nDinner and Overnight at Victoria Blue Hotels &Apartments.','2019-11-14 14:48:05','2019-11-14 14:48:05'),(1292,1963,'09:00','18:00','Kigali International airport','After breakfast, your guide will transfer you to Kigali International Airport for your flight back home.','2019-11-14 14:48:48','2019-11-14 14:48:48'),(1293,1964,'09:00','18:00','Kigali - akagera Natiobal Park','You will be picked up from the Airport or the Hotel in Kigali and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. (Dinner and Overnight at Akagera Game Lodge)','2019-11-15 14:08:51','2019-11-15 14:08:51'),(1294,1965,'07:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.','2019-11-15 14:09:57','2019-11-15 14:09:57'),(1297,1969,'05:30','18:00','Kigali - Volcanoes National Park','You will be picked up from your location in Kigali and then drive  to Volcanoes National park-home to the remaining mountain gorillas in the world, connect directly to the park headquarters for a briefing about the activity as early as 7am, you will then be allocated the ranger guides and you head for the hike. \r\nKarisimbi volcano is the highest of the 8 mountain peaks of Virunga conservation region (Nyiragongo and Nyamuragira volcanoes). The hike is strenuous and challenging so you need to be physically fit to do this hike. \r\n\r\nThis is a 6 hours hike with great views, different bird species and primates. On reaching at an altitude of about 3700m, you will stop at the first camping site where you will spend a night.','2019-11-18 11:13:02','2019-11-18 11:13:02'),(1298,1970,'06:00','18:00','Volcanoes National Park - Kigali','After early breakfast, embark on an hours hike to the summit. At this level the hike is very steep going through trials of thick jungles surrounded by a stunning scenery. \r\nOn reaching at the summit, enjoy amazing views of the surrounding areas like mount Muhabura. After enjoying your time at the summit descent to the starting point where you will meet your driver readily waiting to receive you and connect for late lunch (Self sponsored), Later embark on your journey back to Kigali city.','2019-11-18 11:14:25','2019-11-18 11:14:25'),(1299,1971,'15:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at the Airport. Depending on your arrival time, if you arrive night time, we check into the hotel for a relaxation moment after the long flight.\r\nDinner and Overnight at Hotel des Mille Collines.','2019-11-21 10:23:47','2019-11-21 10:23:47'),(1300,1972,'08:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the Kings Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway.\r\nDinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-21 10:25:15','2019-11-21 10:25:15'),(1301,1973,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to Karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\nDinner and overnight at Moriah Hill Resort.','2019-11-21 10:26:22','2019-11-21 10:26:22'),(1302,1974,'08:00','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake Kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi its about 124Km and road takes about 3hours with no rush. Arriving at Gisenyi where we visit Hot spring, visit DRC-Rwanda border (Gisenyi town). .\r\nDinner and Overnight at  Lake Kivu Serena Hotel.','2019-11-21 10:33:18','2019-11-21 10:33:18'),(1303,1975,'08:00','18:00','Volcanoes National Park - Uganda','After morning breakfast, you will be transferred to Musanze for Ibyiwacu cultural village. This cultural village gives you a chance to meet the local people in their natural environment where youll receive a warm welcome accompanied by traditional dances and drams that are amazing! \r\nYou will just sit and relax while enjoying.  From here you will drive back to your hotel for lunch before being transferred to Bwindi Impenetrable National Park.\r\nDinner and Overnight at Icumbi Gorilla Lodge.','2019-11-21 10:40:12','2019-11-21 10:40:12'),(1304,1976,'07:00','18:00','Bwindi Impenetrable National Park','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for relaxation. \r\n Dinner and Overnight at Icumbi Gorilla Lodge','2019-11-21 10:41:32','2019-11-21 10:41:32'),(1305,1977,'08:00','18:00','Bwindi  - Queen Elizabeth National Park','After an early breakfast, proceed to Queen Elizabeth National Park.  Lunch En- route.  On arrival to Queen Elizabeth National Park, we shall have a short game drive and later drive to your lodge for relaxation. \r\nDinner and Overnight at Mweya Safari Lodge.','2019-11-21 10:42:55','2019-11-21 10:42:55'),(1306,1978,'07:00','18:00','Queen Elizabeth National Park','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators.\r\nDinner and Overnight at Mweya Safari Lodge.','2019-11-21 10:44:16','2019-11-21 10:44:16'),(1307,1979,'08:00','18:00','Queen Elizabeth National Park  -Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your driver guide will drop you at your hotel in Kigali.\r\nDinner and Overnight at Hotel des Mille Collines.','2019-11-21 10:45:59','2019-11-21 10:45:59'),(1308,1980,'09:00','18:00','Kigali International airport','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-21 10:49:44','2019-11-21 10:49:44'),(1309,1981,'08:00','18:00','Kigali -Nyungwe national park','You will depart from Kigali to Nyungwe forest preferably early morning after your breakfast so that we have enough time for stopover at the ethnographic museum in Huye. The journey will take us through Nyanza district and eventually Huye. The ethnographic museum which is also the national museum of Rwanda showcases the historic and cultural aspects of Rwanda through the ages. It has materials and guides to take you through the rich Rwandan culture and history. We will have lunch after the museum experience before continuing on our journey to Nyungwe forest. The roads to Nyungwe after Huye are mostly winding which will give you amazing views of the famous thousand hills. You will have dinner and rest at Gisakura Guest House.','2019-11-21 11:06:39','2019-11-21 11:06:39'),(1310,1982,'05:00','18:00','Nyungwe National Park -Kigali','After breakfast, enjoy Bird watching whole day in the park, where there are over310 species that have been recorded in Nyungwe which reflects a large habitat diversity and the altitudinal range. These also include the 25 species of the Albertine Rift mountains endemic bird Area which occur in Rwanda, The Rockefellers sun bird, Chapins flycatcher. More so, 11 of the 23species of the Guinea Congo Forest biome and also 71 of the 74 species of this biome of the afro tropical highlands that occur in Rwanda and have been recorded at this site. Usually, Nyungwe forest is also the most vital forest for the conservation of Mountainous birds in the region. after here you will drive back to Kigali International Airport for flight/ end of tour.','2019-11-21 11:08:34','2019-11-21 11:08:34'),(1311,1983,'08:00','18:00','Kigali -Volcanoes National Park','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to Gisozi Memorial site for learning more about genocide against Tutsi of 1994, and campaign against genocide. Later you will drive for about 1-2hour to the Volcanoes National Park. (Check in and Dinner at Musanze classic Lodge).','2019-11-21 11:29:46','2019-11-21 11:29:46'),(1312,1984,'07:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel or do a take away in Boxes, then drive for less than 20 minutes to Volcanoes National park headquarters in kinigi for a briefing about the endangered mountain gorillas. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorilla together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, on meeting them, taking pictures and videos with them, it will give you an amazing feeling. After spending about one hour with the mountain gorillas, return to the base and meet your driver and a transfer for lunch and relaxation. After lunch you will go to Ibyiwacu cultural village to learn about the Rwandan culture. Later you will drive back to Kigali for your flight.','2019-11-21 11:31:51','2019-11-21 11:31:51'),(1313,1985,'05:30','18:30','Kigali -Volcanoes National Park','You will be picked up from your location in Kigali and then drive to Musanze for Gorilla naming ceremony in Kinigi, which is an annual special day of giving Baby gorillas names, It is very enjoyable with traditional dances of Rwanda. You will have packed lunch, which you will enjoy while at the event. (This is a whole day Event). Dinner and overnight at Mountain Gorilla View Lodge.','2019-11-21 12:15:46','2019-11-21 12:15:46'),(1314,1986,'06:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your guide and a transfer for lunch. After some relaxation, head to Ibyiwacu Cultural Village where you will have a chance to learn more about the Rwandan traditions and Culture. Dinner and Overnight at Mountain Gorilla View Lodge.','2019-11-21 12:16:48','2019-11-21 12:16:48'),(1315,1987,'08:00','18:00','Volcanoes National Park - Kigali','After breakfast, you will drive to Burera and Ruhondo Lakes to enjoy a fantastic nature walk around the lakes, bird watching, and later a beautiful sundowner cruise while enjoying the outstanding view of the volcanoes with cold drinks and snacks. Later in the evening, drive back to Kigali and be dropped at your desired location.','2019-11-21 12:17:39','2019-11-21 12:17:39'),(1316,1988,'08:00','18:00','Kigali -Gisenyi','You will be picked by our guide or company representative, from your hotel accommodation in Kigali or airport in case you arrive with morning flight and head for a city tour to visit the Kigali Genocide memorial ground where over 25000 bodies of victims of genocide were given a decent burial and later have lunch at Mille Collins Hotel before being transferred to GISENYI. A trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet. The lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley. The distance from Kigali to Lake kivu its about 146Km and road takes about 3hours with no rush. arriving at Gisenyi where we visit the fishing village, visit DRC-Rwanda border (Gisenyi town) and relax at the lakeside in the evening. Overnight and Dinner at Lake kivu hill view hotel.','2019-11-22 09:15:59','2019-11-22 09:15:59'),(1317,1989,'06:00','18:00','Volcanoes National Park - Kigali','After an early breakfast You will be transferred to volcanoes national park for Hiking mountain bisoke. Register with the office and meet with the assigned ranger guides and the other hiking members. The ranger gives a small talk about the hiking activity and important information about the park. you will be getting into the cars and transferring to the starting point of the trek which is about 30 to 45 minutes of drive. Hiking the mountain Bisoke The starting point is at an elevation of 2700 meters above sea level, walk through the local communities and the farmlands at the edge of the park for about 15 minutes before crossing the stone wall into the park. Here theres chance to see mountain Elephants, Buffaloes but it is little chance of the encountering these. After Hiking experience will drive you back to Kigali for your flight.','2019-11-22 09:18:07','2019-11-22 09:18:07'),(1318,1995,'05:00','18:00','Lake Manyara National Park','Pick up from your hotel in Arusha after breakfast, then you will be met by our driver/Guide, who will offer you a short safari information before you depart to Lake Manyara. There after travel west to the Great Rift Valley and the Lake Manyara National Park. You will travel through the agricultural and fresh produce market town of Mto Wa Mbu, which is situated next to the entrance of the Lake Manyara National Park. The town is a souvenir hunters paradise, harboring thousands souvenir salesmen - ready to pounce at your slightest invitation. The Lake Manyara National Park is one of Tanzania\'s most dramatically located African wildlife areas, consisting of a massive but shallow soda lake (covering two-thirds of the park) at the foot of the Great Rift Valley\'s western escarpment. The park\'s varied habitat attracts a wide variety of animals, including one of Africa\'s densely populated African elephants herds, Lake Manyaras famous tree-climbing lions, as well as large flocks of flamingos, attracted by the algae in the lake. We will enjoy a picnic lunch inside the park and do two exciting morning and afternoon game drives, in search of the tree-climbing lions. Late afternoon we depart for Arusha from Lake Manyara where the adventure Safari comes to an end.','2019-12-16 10:28:18','2019-12-16 10:28:18'),(1322,2015,'13:00','18:00','Kigali - akagera Natiobal Park','You will be picked up from your Location in Kigali at 1:00pm and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive). On arrival at the park, we shall have a short game drive. Later driver to Mutumba Campsite for spending a night, with campfire and taking your food.','2019-12-26 11:36:15','2019-12-26 11:36:15'),(1323,2016,'07:00','18:00','Akagera National Park - Kigali','Have a relaxed breakfast and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm.','2019-12-26 12:10:57','2019-12-26 12:10:57'),(1325,2118,'06:00','19:00','Kigali -Akagera National Park','Early Morning, you will be picked up from Kigali International Airport and then drive to Akagera national park. Where we shall do a morning game drive have a picnic lunch in the park, enjoying the beautiful sceneries of Rwandas hilly landscape, comprised of a blend of wattle and, savannah, and woodland, the natural forests also make quite a view. The location of the park shows that it lies at a lower altitude as compared to rest of the country, some of the wildlife you will see here include Giraffes, Buffalos, Elephants as well as a profusion of birds. If fortunate, we may be able to sight at the Shoebill Stork, especially around the shores of the lake. Later drive back to Kigali for Dinner and Overnight at ONOMO Hotel.','2020-01-08 16:22:45','2020-01-08 16:22:45'),(1326,2119,'07:00','18:00','Kigali -Gisenyi','Breakfast and drive to Gisenyi. A trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet. The lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley. The distance from Kigali to Lake Kivu its about 146Km and road takes about 3 hours with no rush. Arriving at Gisenyi where we visit the fishing village, Hot spring, visit DRC-Rwanda border (Gisenyi town). Dinner and Overnight at Lake Kivu Serena Hotel.','2020-01-08 16:26:24','2020-01-08 16:26:24'),(1327,2120,'05:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast or with your packed breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. Later connect back to Kigali city. The driver will either drop you off at where you will be staying in Kigali or proceed and drop you at the airport for your flight.','2020-01-08 16:30:04','2020-01-08 16:30:04'),(1331,2125,'22:00','18:00','Kigali -Akagera National Park','You will be picked up from your Hotel in Kigali and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours drive). On arrival at the park, we shall have a short game drive. Later driver to your hotel for dinner and overnight at Akagera Game Lodge.','2020-01-21 13:11:18','2020-01-21 13:11:18'),(1332,2126,'07:00','19:00','Akagera National park - Musanze','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. And later drive  to Volcanoes National park. Overnight and dinner at Virunga Hotel.','2020-01-21 13:14:40','2020-01-21 13:14:40'),(1333,2127,'06:00','19:00','Volcanoes National Park - Gisenyi','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Gisenyi. Dinner and Overnight at The Palm Beach Hotel.','2020-01-21 13:19:05','2020-01-21 13:19:05'),(1334,2128,'08:00','18:00','Gisenyi -Kigali','Morning after breakfast, you will go for boat ride enjoying the beautiful water, Visit Rubona Peninsula, Hot springs and see the amazing bird life, engage with friendly communities and do something unique in almost all of Africa. Later back to your hotel for lunch and relax, after lunch you will drive back to Kigali.','2020-01-21 13:20:29','2020-01-21 13:20:29'),(1335,2134,'05:00','19:00','Nyungwe National Park','You will be picked up from our office Remerera/Kisimenti and then drive to Nyungwe National Park. Driving South West of Rwanda (4 hours drive). upon arrival in Nyungwe we shall have a registration at the park entrance and later we shall be briefed about the park and the canopy walk .On the canopy walk you will see the many primates like Ihoest monkeys, red tailed monkeys, many vervet monkeys, grey cheeked monkeys, olive baboons and plant species like the common Igishigishi. After the canopy adventure we shall then hike back to the reception and drive to KCCEM guesthouse for lunch &short rest. later drive back to Kigali.','2020-01-21 16:36:23','2020-01-21 16:36:23'),(1336,2135,'08:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. Driving East of Rwanda (3 hours drive) Check-in the Hotel on arrival and have some good rest enjoying a beautiful sunset. Overnight and Dinner at Akagera Game Lodge: Mid Range.','2020-01-22 10:26:48','2020-01-22 10:26:48'),(1337,2136,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, youll continue with the game drive heading north of the park. Youll drive back to Kigali and arrive at around 6pm. Overnight and Dinner  at Hotel des Mille Collines.','2020-01-22 10:30:53','2020-01-22 10:30:53'),(1338,2137,'07:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Huye. We have the opportunity of exploring the Ethnographic Museum in Huye. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway. Overnight and Dinner  at Nyungwe Top View Lodge.','2020-01-22 10:32:31','2020-01-22 10:32:31'),(1339,2138,'06:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the dos and donts while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation. Overnight and Dinner at Moriah Hill Resort.','2020-01-22 10:36:36','2020-01-22 10:36:36'),(1340,2139,'08:00','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake Kivu\r\narriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town). Overnight and Dinner at Kivu Hill View Hotel.','2020-01-22 10:39:09','2020-01-22 10:39:09'),(1341,2140,'05:00','18:00','Gisenyi -Volcanoes National Park','After early morning breakfast or with packed Breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Overnight and Dinner at Ingagi Park View Lodge.','2020-01-22 10:41:13','2020-01-22 10:41:13'),(1342,2141,'08:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast, you will drive to Kigali, take a visit to Gisozi Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2020-01-22 10:42:12','2020-01-22 10:42:12'),(1344,2143,'14:30','22:00','KIGALI','You will be picked up from Kigali Convention Centre / Kigali Marriott Hotel or Kigali Serena hotel and then drive through the city, take a visit to Kigali Memorial Center where there are 250,000 people killed and buried in the mass grave during the Rwanda Genocide against the Tutsi. Thereafter, visit some Local markets where you will have a chance to bargain as locals do and test to African foods such as fruits and drinks. From here you will drive to the most famous Hotel (Hotel des Mille Collines Hotel Rwanda).  Hotel des Mille Collines Inaugurated in 1973 as the premier grand hotel of the country and becoming a shelter to about 2,000 people who were saved by the hotel in 1994 during the Rwanda Genocide against the Tutsi. \r\nYou will Enjoy the most beautiful Rwandan Traditional dances at Hotel Rwanda where youll also be served Dinner.\r\nAfter enjoying your dinner and Cultural Dances, You will be dropped you at your Hotel in Kigali.','2020-01-24 15:38:13','2020-01-24 15:38:13'),(1345,2144,'05:00','18:00','Volcanoes National Park','Early morning you will be picked up from your hotel in Kigali and drive to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will drive back to Kigali.','2020-01-25 16:59:05','2020-01-25 16:59:05'),(1346,2145,'05:00','18:00','Volcanoes National Park','You will be picked up from your Hotel in Kigali and transfer to volcanoes national park. Gather at the park headquarters, attend a short briefing about hiking do and donts ad then transfer to the hiking starting point with your packed lunch and enough drinking water. The hike takes  about 3 - 4 hours to reach the summit and 2 hours to descend. You will enjoy the fresh breath at the volcano summit with spectacular views of Kigali city, neighboring countries and volcanoes national park.   Later be dropped off a preferred location in Kigali.','2020-01-25 17:57:18','2020-01-25 17:57:18');
