INSERT INTO `tour_packages` VALUES (165,119,9,'10 Day Rwanda, Congo & Uganda safari','78285','This Rwanda, Congo and Uganda Safari, will take you to the best destinations in Rwanda, Congo and Uganda. The tour Starts and Ends in Kigali. You will mainly track gorillas and Do Game drives in all the Three Countries.','Rwanda, Congo, Uganda','Kigali','Kigali','5','1560431310.jpg',NULL,NULL,NULL,'2019-06-13 13:08:30','2019-06-14 06:43:16','USD'),(166,119,10,'15 Days Rwanda, Congo, Uganda &Kenya Safaris','100145','This Rwanda, Congo, Uganda and Kenya Safari will take you to the best destinations in Kenya, Uganda, Congo and Rwanda. The tour starts in Kigali Rwanda, proceeds to Congo, Uganda and ends in Nairobi Kenya. You will mainly track gorillas and Do Game drives in all the four Countries.','Rwanda, Kenya, Uganda, Burundi','Kigali','Nairobi','5','1560439389.jpg',NULL,NULL,NULL,'2019-06-13 15:23:09','2019-06-13 15:23:09','USD'),(173,1,8,'5 Days Rwanda Safari','7582','Explore Rwanda, the land of a thousand hills on our 5 Days Rwanda Safari. Visit Chimpanzee and Colobus Monkey in Nyungwe national park, Ibyiwacu cultural Village and Gorilla Trekking in Volcanoes National Park. Tour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1561105895.jpg',NULL,NULL,NULL,'2019-06-21 08:31:35','2019-06-21 08:31:35','USD'),(174,1,9,'8 Days Uganda and Rwanda Tour','4294','The 8Days Uganda and Rwanda Tour involve; game viewing, Water Rafting Along River Nile, Boat cruise at Kazinga channel, Gorilla trekking in Bwindi Forest, a tour to Pygmy village, Uganda Museums. Kivu boat ride and Canopy Walk way in Rwanda. The gorilla Adventure Tour starts in Uganda and Ends in Kigali.','Uganda - Rwanda','Uganda','Rwanda','5','1561109231.jpg',NULL,NULL,NULL,'2019-06-21 09:06:17','2019-06-25 13:28:40','USD'),(175,1,9,'12 Days Uganda Rwanda Gorilla Safaris.','19189','The 12 days Uganda Rwanda Gorilla Safari will take you to these 2 bordered countries and will offer you the best tourist spots such as Volcanoes national park, Queen Elizabeth National park, Kibale Forest, Lake Bunyonyi, Bwindi Impenetrable national park and so much more.\r\nSafari starts and Ends in Kigali','Rwanda, Uganda','Kigali','Kigali','5','1561127057.jpg',NULL,NULL,NULL,'2019-06-21 14:24:17','2019-06-21 14:24:17','USD'),(179,1,8,'7 Days Remarkable Rwanda Safari','2380','7 Days Remarkable Rwanda Safaris Includes: A visit to Rwanda National Museum, canopy walkway and chimpanzee trekking in Nyungwe national park, Lake kivu Boat tour, Golden monkey in Volcanoes National park, game drive and boat ride in Akagera national park','Rwanda','Kigali','Kigali','5','1561378669.jpg',NULL,NULL,NULL,'2019-06-24 12:17:49','2019-06-24 12:17:49','USD'),(180,1,8,'7 Days Best of Rwanda Safari(Min -6pax)','2380','7 days best of Rwanda safari Includes: A visit to Ethnographic Museum, Kings palace Museum, canopy walkway and chimpanzee trekking in Nyungwe national park, Lake kivu Boat tour, Golden Monkey in Volcanoes National park, Game Drive and Boat Ride in Akagera National Park','Rwanda','Kigali','Kigali','5','1561383486.jpg',NULL,NULL,NULL,'2019-06-24 13:38:06','2019-11-12 10:23:35','USD'),(184,1,8,'7 Days- Rwanda Safari (2 pax)','5195','This Rwanda Safari, will take you to the best destinations starting from the Capital City of Rwanda Kigali. You will mainly do a Game Drive at Akagera National Park, Tack the gorillas, Do a canopy walk and Chimpanzee Trekking in Nyungwe national park & Tour the Kivu Lake','Rwanda','Kigali','Kigali','5','1561464122.jpg',NULL,NULL,NULL,'2019-06-25 12:02:02','2019-06-25 12:02:02','USD'),(186,1,9,'6 Days Rwanda Gorilla trek and Uganda wildlife Safari','3577','An adventure 6 day Rwanda gorilla trek and Uganda wildlife safari. You will visit Volcanoes national park and Kibare National park before proceeding to Queen Elizabeth national park for a wildlife experience','Rwanda+Uganda','Kigali','Entebbe','5','1561467953.jpg',NULL,NULL,NULL,'2019-06-25 13:05:53','2019-06-25 13:05:53','USD'),(187,1,12,'12 Days Congo, Rwanda, Uganda & Burundi Safari (9 pax)','5752','12 Days Rwanda, Uganda safari will take you to the best destinations in Rwanda, Burundi,Uganda and DR Congo. The tour starts in Goma, proceed to Rwanda,Uganda and ends in Bujumbura. You will track for gorillas twice in Uganda and Rwanda, take game drives, excellent nature walking, boat trips, cultural excursions and city tours in Kigali and among others','Rwanda+Congo','Goma','Bujumbura','5','1561473211.jpg',NULL,NULL,NULL,'2019-06-25 14:33:31','2019-06-25 14:33:31','USD'),(189,1,11,'4 Days Serengeti Safari','3481','This 4 Days Serengeti Safari takes you to Serengeti National Park which is located in northern part of Tanzania. Serengeti National Park is known for its massive annual migration of wildebeest and zebra. Seeking new pasture, the herds move north from their breeding grounds in the grassy southern plains. Many cross the marshy western corridors crocodile-infested Grumeti River. Others veer northeast to the Lobo Hills, home to black eagles. Black rhinos inhabit the granite outcrops of the Moru Kopjes.','Tanzania','Arusha','Arusha','5','1561652171.jpg',NULL,NULL,NULL,'2019-06-27 16:16:11','2019-06-27 16:16:11','USD'),(198,1,8,'10 Days Rwanda Discover Safari.','8,346','Explore Rwanda, the land of a thousand hills on our 10Days Visit Kigali Genocide Memorial Center, Boat ride and Game drive in Akagera National Park, Ibyiwacu Cultural Village, twin lakes, Gorilla trekking and Golden Monkey in Volcanoes National Park, Lake Kivu Boat ride, canopy walkway and Chimpanzee trekking in Nyungwe national park.','Rwanda','Kigali','Kigali','5','1563790604.jpg',NULL,NULL,NULL,'2019-07-22 10:16:44','2019-07-23 07:52:58','USD'),(199,1,8,'9 Days in Rwanda','8,227','This 9 Days in Rwanda; Includes Boat ride and Game drive in Akagera National Park, Lake Kivu Boat Tour , Canopy Walkway in Nyungwe national park, Golden Monkey, a visit to the Twin lakes in Musanze, Musanze Caves, community experience & Gorilla Trekking in Volcanoes National Park.','Rwanda','Kigali','Kigali','5','1563799320.JPG',NULL,NULL,NULL,'2019-07-22 12:42:00','2019-07-22 12:44:50','USD'),(202,1,8,'9 Days Rwanda  Safari.','7,866','Explore Rwanda, the land of a thousand hills on our 9Days Rwanda Safari. Visit Akagera national park, National Museum, Canopy walk-way, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride, Gorilla Trekking, Ibyiwacu cultural Village &Golden Monkey in Volcanoes National Park. \r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1564060378.JPG',NULL,NULL,NULL,'2019-07-25 13:12:59','2019-07-25 13:12:59','USD'),(203,1,8,'7 Days in Rwanda','5,183','Explore Rwanda, the land of a thousand hills on our 7Days Rwanda Safari. Visit Akagera national park, Gorilla trekking, ibyiwacu cultural village &Golden Monkey in Volcanoes National Park, Lake Kivu Boat ride, Chimpanzee Trekking and Canopy walk-way in Nyungwe national park. Tour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1564064329.jpg',NULL,NULL,NULL,'2019-07-25 14:18:49','2019-07-25 14:18:49','USD'),(205,1,8,'7 Days in Rwanda','5778','Explore Rwanda, the land of a thousand hills on our 7 Days Rwanda Safari. \r\nVisit Akagera national park, National Museum, Canopy walkway, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorillas and Golden Monkeys Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1564408799.jpg','Individual',7,NULL,'2019-07-29 13:59:59','2019-07-29 14:03:49','USD'),(210,1,8,'12 Days in Rwanda','9,551','Explore Rwanda, the land of a thousand hills on our 12 Days/11 Nights  in Rwanda. Visit Akagera national park, Gorilla trekking, ibyiwacu cultural village ,&Golden Monkey in Volcanoes National Park, Twin Lakes, Lake Kivu Boat ride, Chimpanzee Trekking and Canopy walk-way & Gisakura Tea Factory in Nyungwe national park, Ethnographic Museum and King\'s palace museum in Nyanza.\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1565780686.jpg','N/A',7,0,'2019-08-14 11:04:46','2019-08-14 11:04:46','USD'),(218,1,12,'4 Days Congo Gorilla Trek and Nyiragongo Hike','2,390','This 4 days in Congoi; Includes Congo Mountain Gorilla Trekking and Mountain Nyiragongo Hike. Tour Starts and Ends in Rwanda','Rwanda -Congo','Rwanda','Rwanda','5','1566062263.jpg','N/A',7,0,'2019-08-17 17:17:43','2019-08-17 17:17:43','USD'),(226,1,9,'2 Days Uganda Gorilla Safari.','1350','The 2 days / 1 night  uganda Gorilla Safari  starts and ends in Kigali the capital city of Rwanda.  It\'s includes Gorilla trekking and Batwa Experience in Bwindi National Park.','Rwanda - Uganda','Kigali','Kigali','0','1567430126.jpg','N/A',7,0,'2019-09-02 13:05:45','2019-09-02 13:15:26','USD'),(232,1,9,'1 Day Jinja City Tour.','200','Jinja city is located North of Lake Victoria and according to sir Churchill Livingstone, it is here that he discovered the beginning of the longest River in Africa. Jinja is also home of the kingdom of Busoga and thus houses the palace of the kings, and also the Kagulu hills believed to be the ancestral home of ancient Basoga Kings.\r\n\r\nTour starts and ends in Kampala.','Uganda','Kampala','Kampala','0','1567769050.jpg','N/A',7,0,'2019-09-06 11:24:10','2019-09-06 11:24:10','USD'),(233,1,8,'11Days Rwanda Adventure Tour','8,476','11 Days Rwanda Adventure Tour Includes; chimpanzees tracking, colobus monkey and canopy walk way in Nyungwe national park, Kibuye and Gisenyi tours, a tour to Ibyiwacu Cultural Village& Tour to Twin lakes, Gorilla trekking, Golden Monkey trek in Volcanoes national park, Boat ride and game drive in akagera national park.\r\n\r\nTour starts and ends in Kigali.','KIGALI','Kigali','Kigali','0','1567774557.jpg','N/A',7,0,'2019-09-06 12:55:57','2019-09-06 12:55:57','USD'),(241,1,11,'7 Days Marangu Route, Mount Kilimanjaro.','750','The Marangu route is perhaps the easiest and most comfortable route to reach the summit of Mt Kilimanjaro. The route is well-developed and the climb is constant and moderate. Only the approach to the summit is the exception as it is slightly more demanding. The accommodation on this tour is in simple mountain huts, which might be an advantage compared to the camping routes.','Tanzania','Arusha','Arusha','0','1568812950.jpg','N/A',7,0,'2019-09-18 13:17:43','2019-09-18 13:38:22','USD'),(260,1,8,'15 DAYS  SAFARI IN RWANDA','12,245','Explore Rwanda, the land of a thousand hills on our 15Days/14Nights Rwanda Safari. \r\nVisit Rwanda national parks, Community Activities, Cultural tours and Boat tours on Kivu lake and Twin Lakes. Tour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1570536094.jpg','N/A',7,0,'2019-10-08 12:01:34','2019-10-08 12:01:34','USD'),(261,1,8,'8 Days in Rwanda','6105','This 8 Days includes; a visit to Gisozi Memorial Site, Kings Palace Museum, Ethnographic museum, Chimpanzee tracking, Kamiranzovu Water fall, canopy walkway, and Gisakura Tea Factory in Nyungwe National Park, Lake kivu Boat ride, Ibyiwacu cultural village, bisoke hike &Gorilla trekking in Volcanoes National park.','Rwanda','Kigali','Kigali','0','1571052527.JPG','N/A',NULL,0,'2019-10-14 11:28:47','2019-11-05 12:49:33','USD'),(262,1,8,'12 Days in Rwanda','9551','Explore Rwanda, the land of a thousand hills on our 12 Days/11Nights Rwanda Safari. \r\nVisit Akagera national park, Kings Palace Museum, Canopy walkway, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorillas and Golden Monkeys Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1571055131.JPG','N/A',5,0,'2019-10-14 12:12:11','2019-10-14 12:12:11','USD'),(264,1,8,'4 Days Safari In Rwanda','2,226','4 Days Rwanda Safari will start and end in Kigali Rwandas Capital it includes; Kigali City Tour ,Akagera boat ride and Game Drive.','KIGALI','Kigali','Kigali','0','1571063930.jpg','N/A',5,0,'2019-10-14 14:38:50','2019-10-14 14:38:50','USD'),(265,1,8,'4 Days Rwanda Cycling Tour','1,800','This 4Days Musanze cycling tour will give you a different feel from the car and hiking opportunities. You will explore the communities close by and benefit from exercising and enjoying the freshness from the countryside.','Rwanda','Kigali','Kigali','0','1571065747.jpg','N/A',5,0,'2019-10-14 15:09:07','2019-10-14 15:09:07','USD'),(266,1,9,'8 Days Uganda and Rwanda Tour','3,174','8 Days Rwanda  &Uganda Safari will start and end in Kigali Rwandas Capital it includes; Canopy walk way & Chimpanzee Trekking in Nyungwe National park. Game Drive in Akagera National Park, Lake Kivu Boat ride , Ibyiwacu cultural Village and Uganda Gorilla Trekking in Bwindi National Park.','Rwanda - Uganda','Kigali','Kigali','0','1571220026.jpg','N/A',5,0,'2019-10-16 09:34:14','2019-10-16 10:00:26','USD'),(268,1,9,'3 Days Rwanda &Uganda  Gorilla Safari','1,340','3 Days Rwanda& Uganda Gorilla Safari will starts and ends in Kigali Rwandas Capital it includes; Twin lake Burera &Ruhondo, Batwa forest experience and gorilla trekking in bwindi impenetrable national park.','Rwanda - Uganda','Kigali','Kigali','0','1571223038.jpg','N/A',5,0,'2019-10-16 10:50:38','2019-10-16 10:50:38','USD'),(269,1,9,'4 Days Double Uganda Gorilla Trekking.','3,670','With this 4-Day Double Gorilla Trekking  Uganda Tour through Kigali - Rwanda, one gets to drive for only 4-5 hours from Kigali to Bwindi National Park . Tour will start and end in Kiagli Rwanda.','Rwanda - Uganda','Kigali','Kigali','0','1571233870.jpg','N/A',5,0,'2019-10-16 13:51:10','2019-10-16 13:51:10','USD'),(270,1,9,'5 Days Rwanda and Uganda Tour','3,972','An adventure 5 Days Rwanda &Uganda You will visit Ibyiwacu Cultural Village in musanze, Lake bunyonyi and  Gorilla trekking in Bwindi National Park.','Rwanda - Uganda','Kigali','Kigali','0','1571324466.jpg','N/A',5,0,'2019-10-17 15:01:06','2019-10-17 15:01:06','USD'),(271,1,9,'7 Days  Rwanda and Uganda Safari','5,095','In this 7 days Rwanda and Uganda Safari, you will visit Ibyiwacu cultural  Village in musanze, Kigali City ,Twin lakes , Batwa Forest Experience and Gorilla trekking in Bwindi National Park, Boat ride on kazinga channel and Game drive in Queen Elizabeth National Park.','Rwanda - Uganda','Kigali','Kigali','0','1571410039.jpg','N/A',NULL,0,'2019-10-18 14:45:57','2019-10-18 14:47:19','USD'),(277,1,14,'1 Day Mountain Bisoke Hike.','50000','A One Day Rwanda tour to hike Mount Bisoke is one the thrilling experiences you should not miss on your Rwanda safari. Travelers hike and descend on the same day hence a chance for short time travelers. Mount Bisoke stands at 3,711 meters and one the 8 volcanoes that make the chain of the Virunga volcanoes.\r\n\r\nTour Starts and Ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1571657669.jpg','N/A',7,0,'2019-10-21 11:34:29','2020-01-26 12:14:54','RWF'),(279,1,14,'1 Days Akagera Safari.','40000','1 Day Akagera Safari takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos.\r\n\r\nTour will starts and end in Kigali.','Rwanda','Kigali','Kigali','0','1571662730.JPG','N/A',7,0,'2019-10-21 12:58:50','2020-01-25 15:07:13','RWF'),(281,1,14,'2 Days  Akagera Group Tour.','322000','2 Days Akagera group tour takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos','Akagera National Park','Kigali','Kigali','0','1571665834.JPG','N/A',14,0,'2019-10-21 13:50:34','2019-10-21 13:50:34','RWF'),(284,1,14,'2 Days Karisimbi Hiking Adventure','179400','The Mount Karisimbi hiking is one of the most memorable activities in Rwanda, hiking to the top of mount Kalisimbi is one of the key tourism activities you should not miss on your Rwanda safari to Volcanoes National park.','Volcanoes National Park','Kigali','Kigali','0','1571668164.jpg','N/A',14,0,'2019-10-21 14:29:24','2019-10-21 14:29:24','RWF'),(285,1,14,'2 Day Nyungwe Group Tour.','322000','This 2 Days Nyungwe Group Tour takes you to the Nyungwe National Parkfor. Nyungwe is located in the south west, covering an area of 1016 kms across the majestic hills of southeast Rwanda, Nyungwe National Park is the largest mountainous rain forest in central and east Africa and one of the most ancient, dating back to before the Ice Age. The forest supports over 1025 plant species, and over than 500 species of orchid and giant lobelia. Nyungwe also has 13 species of primates; these include chimpanzees and the Black and White Angolan colobus monkeys. It is also home to habituated species such as the Mangabeys and the Blue Monkeys. Nyungwe forest has its own Canopy. And its the only canopy in East Africa.','Nyungwe National Park','Kigali','Kigali','0','1571739375.jpg','N/A',14,0,'2019-10-22 10:16:15','2019-10-22 10:16:15','RWF'),(286,1,14,'4 Days  Rwanda Tour','552000','This 4 Days Rwanda Tour; Includes Game drive in Akagera National Park, Lake Kivu Boat Tour and Golden Monkey in Volcanoes National Park.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','K