','Volcanoes National Park','Kigali','Kigali','0','1574338113.jpg','N/A',NULL,0,'2019-11-21 12:08:33','2019-11-21 12:19:40','RWF'),(336,1,8,'2 Days - Kivu Boat Ride & Bisoke Hike (Min - 6Pax)','459080','This 2 Days / 1Night includes; Lake Kivu Boat ride\r\nand Hike to Mountain Bisoke Crater Lake in Volcanoes National Park.\r\n\r\nThe Tour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1574413528.jpg','N/A',NULL,0,'2019-11-22 09:05:28','2019-11-22 09:20:52','RWF'),(341,1,11,'Day Safari to Lake Manyara National Park','62040','This one-day safari takes you to Lake Manyara National Park. Lake Manyara National Park is a protected area in Tanzania\'s Arusha and Manyara Regions, situated between Lake Manyara and the Great Rift Valley. It is administered by the Tanzania National Parks Authority, and covers an area of 325 km including about 230 km lake surface. Lake Manyara has a big number of elephants, so many giraffes; zebras, wildebeest, impala, waterbuck, and warthog, small known shy Kiks dik dik as well as Klipspringer along the ramps of the escarpment.\r\nTour Starts and Ends in Arusha.','Lake Manyara National Park','Arusha','Arusha','0','1575888563.jpg','N/A',NULL,0,'2019-12-09 10:49:23','2019-12-09 15:04:38','RWF'),(345,1,11,'2Days Trip to Tarangire&Ngorongoro (Min-6 pax)','282000','A short 2 day program to enjoy wildlife and landscape, the tour will lead you towards Tarangire National Parks famous as Small Serengeti. The park is well-known for its giant Baobab trees, huge herds of elephants, plains game, and predators. Ngoro Ngoro Crater where you will descend 2000 feet home to large numbers of wildlife and exhilarating landscapes. The best quick tour to experience two of the best Tanzania National park.\r\n\r\nTour Starts and Ends in Arusha.','Tanzania','Arusha','Arusha Town','0','1576758151.jpg','N/A',NULL,0,'2019-12-19 12:22:31','2019-12-19 12:22:31','RWF'),(346,1,11,'2Days Trip to Tarangire&Ngorongoro (Min-6 pax)','282000','A short 2 day program to enjoy wildlife and landscape, the tour will lead you towards Tarangire National Parks famous as Small Serengeti. The park is well-known for its giant Baobab trees, huge herds of elephants, plains game, and predators. Ngoro Ngoro Crater where you will descend 2000 feet home to large numbers of wildlife and exhilarating landscapes. The best quick tour to experience two of the best Tanzania National park.\r\n\r\nTour Starts and Ends in Arusha.','Tanzania','Arusha','Arusha Town','0','1576758742.jpg','N/A',NULL,0,'2019-12-19 12:32:22','2019-12-19 12:32:22','RWF'),(348,1,11,'2Days ttrip to Tarangire&Ngorongoro ( Min 6 Pax)','282000','A short 2 day program to enjoy wildlife and landscape, the tour will lead you towards Tarangire National Parks famous as Small Serengeti. The park is well-known for its giant Baobab trees, huge herds of elephants, plains game, and predators. Ngoro Ngoro Crater where you will descend 2000 feet home to large numbers of wildlife and exhilarating landscapes. The best quick tour to experience two of the best Tanzania National park.\r\n\r\nTour Starts and Ends in Arusha.','Tanzania','Arusha','Arusha','0','1576759308.jpg','N/A',NULL,0,'2019-12-19 12:41:48','2019-12-19 12:41:48','RWF'),(349,1,11,'2Days trip to Tarangire&Ngorongoro ( Min 6 Pax)','282000','A short 2 day program to enjoy wildlife and landscape, the tour will lead you towards Tarangire National Parks famous as Small Serengeti. The park is well-known for its giant Baobab trees, huge herds of elephants, plains game, and predators. Ngoro Ngoro Crater where you will descend 2000 feet home to large numbers of wildlife and exhilarating landscapes. The best quick tour to experience two of the best Tanzania National park.\r\n\r\nTour Starts and Ends in Arusha.','Tanzania','Arusha','Arusha','0','1576759519.jpg','N/A',NULL,0,'2019-12-19 12:45:19','2019-12-19 12:45:19','RWF'),(350,1,11,'2Days trip to Tarangire&Ngorongoro ( Min 6 Pax)','282000','A short 2 day program to enjoy wildlife and landscape