border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bush bucks, Water bucks and most recently Black Rhinos.\r\n\r\nTour Starts and Ends in Kigali.','Akagera','kigali','Kigali','0','1576761623.jpg','N/A',NULL,0,'2019-12-19 13:20:23','2019-12-26 11:20:51','RWF'),(355,1,12,'10  Days - Rwanda,Congo & Uganda Safari.','7029320','This Rwanda, Congo and Uganda Safari, will take you to the best destinations in Rwanda, Congo, and Uganda. The tour Starts and Ends in Kigali. You will mainly track gorillas and Do Game drives in all the Three Countries.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda- Congo - Uganda','Kigali','Kigali','0','1576762743.jpg','N/A',NULL,0,'2019-12-19 13:39:03','2019-12-26 12:30:33','RWF'),(356,1,8,'5 Days Rwanda Adventure','1677720','It will start and end in Kigali Rwandas Capital it includes Kigali Genocide Memorial Centre, Rwanda National Museum, Kivu Boat ride, Canopy walkway & Chimpanzee Trekking in Nyungwe National park.','Akagera','Kigali','Kigali','0','1576763571.jpg','N/A',NULL,0,'2019-12-19 13:52:51','2019-12-19 13:52:51','RWF'),(357,1,13,'7 DAYS RWANDA & BURUNDI','1472000','This 7 days Rwanda and Burundi Tour Includes; Canopy Walk Way and Chimpanzee Trekking in Nyungwe National Park, a visit to the source of Nile, Karere Waterfalls and Gishora drum sanctuary in Burundi.\r\n\r\nTour starts and Ends in Kigali Rwanda.','Burundi','Kigali','Kigali','0','1576764635.jpg','N/A',NULL,0,'2019-12-19 14:10:35','2019-12-19 14:10:35','RWF'),(358,1,8,'10 DAYS IN RWANDA','6556500','Explore Rwanda, the land of a thousand hills on our 10Days Rwanda Safari. Visit Akagera national park, Kings Palace Museum, Canopy walk-way, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride, Gorilla Trekking, Ibyiwacu cultural Village, Twin Lakes &Golden Monkey in Volcanoes National Park. \r\nTour starts and ends in Kigali.','Rwanda','Kigali','Kigali','0','1576766075.jpg','N/A',NULL,0,'2019-12-19 14:34:36','2019-12-19 14:34:36','RWF'),(365,1,12,'20 DAYS CONGO, RWANDA, BURUNDI, UGANDA & KENYA SAFARI.','14786070','20 Days 5 Countries, an adventure tour to Congo, Rwanda, Burundi, Uganda, and Kenya Includes, Gorilla trekking, Mountain Nyiragongo Hike, Chimpanzee Trekking, Canopy Walk Way, Wildlife Game Viewing, Water Falls, Lakes, Beautiful Sceneries and Cultural Visits.\r\nThe Tour Starts in Congo and Ends in Nairobi Kenya.','Rwanda-RD Congo','Goma','Nairobi','0','1576771049.jpg','N/A',NULL,0,'2019-12-19 15:57:29','2019-12-19 15:57:29','RWF'),(366,1,10,'20 DAYS CONGO, RWANDA, BURUNDI, UGANDA & KENYA','14786070','20 Days 5 Countries, an adventure tour to Congo, Rwanda, Burundi, Uganda, and Kenya Includes, Gorilla trekking, Mountain Nyiragongo Hike, Chimpanzee Trekking, Canopy Walk Way, Wildlife Game Viewing, Water Falls, Lakes, Beautiful Sceneries and Cultural Visits.\r\nThe Tour Starts in Congo and Ends in Nairobi Kenya.','Rwanda-kenya','Goma','Nairobi','0','1576773175.jpg','N/A',NULL,0,'2019-12-19 16:32:55','2019-12-19 16:32:55','RWF'),(367,1,8,'5 Days 4Nights-Rwanda Safari','3260580','Explore Rwanda, The land of a thousand hills on our 5 Days/4Nights Rwanda Tour. Explore the \r\nKigali City, Genocide Memorial Center, Rwanda National Museum, Chimpanzee, Black & White monkeys Trekking, Canopy walkway in Nyungwe national park plus a Lake Kivu Boat Tour.','Rwanda','kigali','kigali','0','1576778159.jpg','N/A',NULL,0,'2019-12-19 17:55:59','2019-12-19 17:55:59','RWF'),(379,1,8,'3 Days Rwanda Gorilla & Wildlife Safari','3689500','This 3 days Rwanda Gorilla safari; Includes Game drive in Akagera National Park, Lake Kivu Boat Tour and Gorilla Trekking in Volcanoes National Park.','Rwanda','Kigali','Kigali','0','1578499803.jpg','N/A',7,0,'2020-01-08 16:10:03','2020-01-08 16:10:03','RWF'),(383,1,8,'4 Days in Rwanda','2181740','This 4 Days Rwanda Safari will starts and Ends in Kigali Rwanda  and it\'s Includes; Akagera Game drive , Lake Kivu boat ride and Golden Monkey in Volcanoes National Park.','Rwanda','Kigali','Kigali','0','1579611595.JPG','N/A',7,0,'2020-01-21 12:59:55','2020-01-21 12:59:55','RWF'),(390,1,14,'1 Day Canopy Adventure.','30000','This 1-day Canopy adventure takes you to Nyungwe National Park\r\nfor the canopy walk along the trails. Nyungwe is located in the south west, covering an area of 1016 kms across the majestic hills of southeast Rwanda. Nyungwe National Park is the largest mountainous rain forest in central and east Africa and one of the most ancient, dating back to before the Ice Age. The forest supports over 1025 plant species, and 500 species of orchid and giant lobelia. Nyungwe also has 13 species of primates; these include chimpanzees, Black and White Angolan Columbus monkeys. It is also home to habituated species such as the Mangabeys and the Blue Monkeys. Nyungwe forest has it\'s own Canopy. And its the only canopy in East Africa.\r\n\r\nTour  Starts and Ends in Kigali.','Nyungwe','Kigali','Kigali','0','1579624372.JPG','Group',NULL,0,'2020-01-21 16:32:52','2020-01-26 12:29:58','RWF'),(391,1,8,'7 Days Rwanda Safari','5490540','Explore Rwanda, the land of a thousand hills on our 7 Days/6 Nights Rwanda Safari. \r\nVisit Akagera national park, Ethnographic Museum, Canopy walkway, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorilla Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\n\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1579688560.jpg','N/A',7,0,'2020-01-22 10:22:40','2020-01-22 10:22:40','RWF'),(393,1,14,'Kigali Afternoon City Tour.','73320','This Kigali Afternoon city tour itinerary gives you an exceptional feel of Africas beautiful and cleanest city Kigali which is also a hub of the rolling A thousand hills of Rwanda. This tour includes a visit to Kigali Genocide Memorial site, Local markets, Craft shops and Rwandan Traditional Dances at the famous Mille Collines Hotel (Hotel Rwanda) \r\n\r\nTour Starts and Ends in Kigali.','KIGALI','Kigali','Kigali','0','1579880160.jpg','N/A',7,0,'2020-01-24 15:36:00','2020-01-24 15:36:00','RWF'),(394,1,8,'1 Day Gorilla trekking Tour.','1598000','This 1 day gorilla tour is designed for clients who dont have much stay in Rwanda but would like a gorilla experience. This Gorilla tour takes you to volcanoes national park were the mountain gorilla families are found.\r\n\r\nTour starts and ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1579970959.jpg','N/A',7,0,'2020-01-25 16:49:19','2020-01-25 16:49:19','RWF'),(395,1,8,'Day Trip to Mountain Bisoke.','217000','Mount Bisoke volcano is a dormant volcano part of the 8 volcanoes of the Virunga conservation region of East and Central Africa. Mount Bisoke stands at 3,711 meters with a crater lake and beautiful vegetation at the summit. Hiking mount Bisoke is a 1 day hike which requires good fitness and its a tough steep hike and advisable to take a porter to help carry your water and day pack.\r\n\r\nTour Will starts and End in Kigali','Volcanoes National Park','Kigali','Kigali','0','1579972733.jpg','N/A',7,0,'2020-01-25 17:18:53','2020-01-25 17:18:53','RWF'),(396,1,8,'Day Trip to Akagera  National Park.','200000','1 Day Akagera Safari takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos.\r\n\r\nTour Will starts and End in Kigali.','Akagera National Park','Kigali','Kigali','0','1580044388.jpg','N/A',7,0,'2020-01-26 13:13:08','2020-01-26 13:13:08','RWF');
